insert  into `catalog_category_entity_text`(`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (1,3,65,0,1,NULL),(2,3,65,1,1,NULL),(5,3,44,0,3,NULL),(6,3,47,0,3,NULL),(7,3,48,0,3,NULL),(8,3,62,0,3,NULL),(9,3,65,0,3,NULL),(85,3,44,0,9,NULL),(86,3,47,0,9,NULL),(87,3,48,0,9,NULL),(88,3,62,0,9,NULL),(89,3,65,0,9,NULL),(138,3,44,0,18,NULL),(139,3,47,0,18,NULL),(140,3,48,0,18,NULL),(141,3,62,0,18,NULL),(142,3,65,0,18,NULL),(143,3,44,0,19,NULL),(144,3,47,0,19,NULL),(145,3,48,0,19,NULL),(146,3,62,0,19,NULL),(147,3,65,0,19,NULL),(148,3,44,0,20,NULL),(149,3,47,0,20,NULL),(150,3,48,0,20,NULL),(151,3,62,0,20,NULL),(152,3,65,0,20,NULL),(158,3,44,0,21,NULL),(159,3,47,0,21,NULL),(160,3,48,0,21,NULL),(161,3,62,0,21,NULL),(162,3,65,0,21,NULL),(163,3,44,0,22,NULL),(164,3,47,0,22,NULL),(165,3,48,0,22,NULL),(166,3,62,0,22,NULL),(167,3,65,0,22,NULL),(168,3,44,0,23,NULL),(169,3,47,0,23,NULL),(170,3,48,0,23,NULL),(171,3,62,0,23,NULL),(172,3,65,0,23,NULL),(198,3,44,0,24,NULL),(199,3,47,0,24,NULL),(200,3,48,0,24,NULL),(201,3,62,0,24,NULL),(202,3,65,0,24,NULL),(203,3,44,0,25,NULL),(204,3,47,0,25,NULL),(205,3,48,0,25,NULL),(206,3,62,0,25,NULL),(207,3,65,0,25,NULL),(208,3,44,0,26,NULL),(209,3,47,0,26,NULL),(210,3,48,0,26,NULL),(211,3,62,0,26,NULL),(212,3,65,0,26,NULL),(213,3,44,0,27,'<p>Для всех людей с диагнозом &laquo;сахарный диабет&raquo; необходимо проводить контроль уровня глюкозы в крови. Только при проведении самоконтроля возможно назначение врачом правильного лечения, внесение изменнений в рацион питания и достижение стабильной компенсации сахарного диабета.</p><p class=\"message bg-info text-info\">Прибор, с помощью которого можно быстро и точно измерить уровень глюкозы в крови называется <a href=\"martana.su\">глюкометр</a>. В настоящее время это самый лучший способ самоконтроля.Существует несколько методик измерения по принципу действия глюкометров:</p>\r\n<ul>\r\n<li>&nbsp;<a href=\"martana.su\">Фотометрический</a>, который основан на определении изменения интенсивности окраски цветового контрольного окна тест-полоски, возникающего в результате взаимодействия глюкозы крови и специального реагента, нанесенного на тест-полоску. После изменения интенсивности окраски контрольного поля тест-полоски показатель преобразуется в значение, которое выводится на дисплей.</li>\r\n<li><a href=\"martana.su\">Электрохимический</a>, который основан на измерении уровня глюкозы в крови в соответствии с величиной силы тока или изменении заряда электронов, которые появляются в результате взаимодействия глюкозы крови и реагента тест-полоски.</li>\r\n</ul>\r\n<p>Глюкометры также могут различаться по калибровке (по плазме или по цельной крови) и по способу кодирования прибора, способу нанесения капли крови на тест-полоску.</p>\r\n<p>В дополнение к каждому глюкометру идут ручки-скарификаторы для прокалывания пальца, комплект одноразовых ланцетов, к большинству глюкометров в комплекте содержится 10 тест-полосок. Каждый производитель производит к своему глюкометру уникальные тест-полоски, которые совместимы только с конкретной моделью глюкометра данного производителя.</p>\r\n<p>Кроме уровня глюкозы в крови, всем людям, больным сахарным диабетом необходимо измерять:</p>\r\n<ul>\r\n<li>уровень кетоновых тел;</li>\r\n<li>холестерин (некоторые глюкометры приспособлены для измерения этих параметров);</li>\r\n<li>уровень гликированного гемоглобина, который рекомендуется измерять не реже одного раза в три месяца.</li>\r\n</ul>\r\n<p>Существует несколько методов определения гликированного гемоглобина: хроматографические, колориметрические и иммунохимические. Все они проводятся в лабораториях при помощи дорогостоящих приборов. Для медицинских лабораторий у нас имеются <a href=\"martana.su\">специальные предложения</a>.&nbsp;</p>\r\n<p>В нашей аптеке представлены глюкометры следующих производителей: Roche Diagnostics GmbH, Германия, Johnson &amp; Johnson (США), Abbott (США), Бионайм (Швейцария), Байер (Bayer), Элта, Россия, 77 Elektronika Kft, Венгрия</p>'),(214,3,47,0,27,'глюкометры,сахарный диабет, инсулин, средства контроля, холестирин, глюкоза в крови'),(215,3,48,0,27,'глюкометры, контроль уровня глюкозы в крови'),(216,3,62,0,27,NULL),(217,3,65,0,27,NULL),(218,3,44,0,28,'<p class=\"message bg-info text-info\">Визуальные тест-полоски используются для качественного и полуколичественного анализа различных показателей без прибора:</p>\r\n<ul>\r\n<li>&nbsp;Уровня глюкозы в крови (например, тест-полоски Бетачек);</li>\r\n</ul>\r\n<p>При помощи визуальных тест-полосок возможно определение следующих показателей в моче:</p>\r\n<ul>\r\n<li>Уровня глюкозы (тест-полоски Уриглюк);</li>\r\n<li>Кетоновых тел (тест-полоски Урикет);</li>\r\n<li>Белка (тест-полоски Урибел);</li>\r\n<li>pH (тест-полоски Ури- pH);</li>\r\n<li>Тест-полоски, в которых совмещено определение глюкозы и кетоновых тел.</li>\r\n</ul>\r\n<p>Визуальные тест-полоски могут быть использованы в медицинских учреждениях и в домашних условиях. В основе полуколичественного метода лежит взаимодействие активного вещества и реагента, нанесенного на тест-полоску, изменение цвета полоски и интенсивности ее окраски, которая затем сравнивается с эталоном на цветовой шкале, нанесенной на упаковку.</p>\r\n<p>Метод дает возможность контролировать различные показатели в биологических жидкостях, контролировать ход лечения, а также подобрать соответствующую диету.</p>'),(219,3,47,0,28,'тест-полоски, уровень глюкозы в крови, сахарный диабет, диета'),(220,3,48,0,28,'тест-полоски, измерение уровня глюкозы в крови'),(221,3,62,0,28,NULL),(222,3,65,0,28,NULL),(232,3,44,0,29,NULL),(233,3,47,0,29,NULL),(234,3,48,0,29,NULL),(235,3,62,0,29,NULL),(236,3,65,0,29,NULL),(237,3,44,0,30,'<p>Инсулин &ndash; лекарственный препарат, который применяется для замещения недостатка выработки гормона поджелудочной железы. Введение препаратов инсулина в настоящее время является единственным способом устранения его абсолютной недостаточности при разрушении клеток поджелудочной железы.</p>\r\n<p><strong>ПРЕПАРАТЫ ИНСУЛИНА ДОЛЖНЫ ПРИНИМАТЬСЯ ТОЛЬКО ПО НАЗНАЧЕНИЮ ВРАЧА. </strong></p>\r\n<p><strong>НИ В КОЕМ СЛУЧАЕ НЕ СЛЕДУЕТ РЕКОМЕНДОВАТЬ ПРЕПАРАТЫ ИНСУЛИНА СВОИМ РОДСТВЕННИКАМ, ДРУЗЬЯМ, ИЛИ ЗНАКОМЫМ. НЕЛЬЗЯ ИЗМЕНЯТЬ ДОЗИРОВКУ ИНСУЛИНА САМОСТОЯТЕЛЬНО, БЕЗ КОНСУЛЬТАЦИИ ПАЦИЕНТА С ВРАЧОМ. СМЕНА ДОЗИРОВКИ ИНСУЛИНА ДОЛГО МОЖЕТ НЕ ПРОЯВЛЯТЬСЯ &laquo;ВНЕШНЕ&raquo;, ТО ЕСТЬ ЧЕЛОВЕК МОЖЕТ НЕ ЗАМЕЧАТЬ ИЗМЕНЕНИЙ СОСТОЯНИЯ ОРГАНИЗМА,&nbsp; ОДНАКО ЭТО ОБЯЗАТЕЛЬНО ОТРАЗИТСЯ НА ПОКАЗАТЕЛЯХ В КРОВИ.</strong></p>\r\n<p><strong>ФАРМАЦЕВТ НЕ МОЖЕТ ПРИНЯТЬ РЕШЕНИЕ О НАЗНАЧЕНИИ ИНСУЛИНА, ИЗМЕНЕНИИ ДОЗИРОВКИ ИЛИ ЗАМЕНЫ ПРЕПАРАТА ИНСУЛИНА. В САМЫХ КРАЙНИХ СЛУЧАЯХ, КОГДА ПАЦИЕНТУ СРОЧНО НУЖЕН ИНСУЛИН, ВОЗМОЖЕН ПОДБОР АНАЛОГИЧНОГО ПРЕПАРАТА ИНСУЛИНА (С ТОЧНО ТАКИМ ЖЕ ДЕЙСТВУЮЩИМ ВЕЩЕСТВОМ), НО ДРУГОГО ПРОИЗВОДИТЕЛЯ.</strong></p>\r\n<p><strong>&nbsp;ПРИОБРЕТАЯ У НАС ПРЕПАРАТЫ ИНСУЛИНА, ВЫ МОЖЕТЕ БЫТЬ УВЕРЕНЫ, ЧТО ОНИ ХРАНИЛИСЬ ПРИ ПОЛНОМ СОБЛЮДЕНИИ ТЕМПЕРАТУРНОГО РЕЖИМА. МЫ ГАРАНТИРУЕМ, ЧТО ТРАНСПОРТИРОВКА ПРЕПАРАТОВ ИНСУЛИНА ПРОВОДИТСЯ С ПОЛНЫМ СОБЛЮДЕНИЕМ </strong><a href=\"martana.su\"><strong>ХОЛОДОВОЙ ЦЕПОЧКИ</strong></a><strong>.</strong></p>\r\n<p>Препараты инсулина различаются по происхождению, по длительности действия и по степени очистки. В настоящее время используются препараты так называемого человеческого инсулина, полученные методом генной инженерии и его синтетические аналоги. В нашей аптеке представлены инсулины производителей Ново Нордиск, Эли Лилли, Фармстандарт и Санофи Авентис. Выбор инсулина, его дозировки и способа введения должен быть индивидуальным и осуществляться лечащим врачом.</p>'),(238,3,47,0,30,'инсулин, сахарный диабет, глюкоза'),(239,3,48,0,30,'Инсулин – лекарственный препарат, который применяется для замещения недостатка выработки гормона поджелудочной железы. '),(240,3,62,0,30,NULL),(241,3,65,0,30,NULL),(242,3,44,0,31,'<p>Сахароснижающие лекарственные препараты, которые выпускаются в виде таблеток, применяются для лечения сахарного диабета только 2 типа.</p>\r\n<p><strong>ВСЕ САХАРОСНИЖАЮЩИЕ ПРЕПАРАТЫ В ТАБЛЕТКАХ ДОЛЖНЫ ПРИМЕНЯТЬСЯ ТОЛЬКО ПО НАЗНАЧЕНИЮ ВРАЧА.</strong></p>\r\n<p><strong>НЕ СЛЕДУЕТ РЕКОМЕНДОВАТЬ ТАБЛЕТИРОВАННЫЕ САХАРОСНИЖАЮЩИЕ ПРЕПАРАТЫ СВОИМ РОДСТВЕННИКАМ, ДРУЗЬЯМ, ИЛИ ЗНАКОМЫМ. </strong></p>\r\n<p><strong>ФАРМАЦЕВТ НЕ МОЖЕТ ПРИНЯТЬ РЕШЕНИЕ О НАЗНАЧЕНИИ САХАРОСНИЖАЮЩЕГО ПРЕПАРАТА В ТАБЛЕТКАХ, ИЗМЕНЕНИИ ДОЗИРОВКИ ИЛИ ЕГО ЗАМЕНЫ. ВОЗМОЖЕН ТОЛЬКО ЛИШЬ ПОДБОР АНАЛОГИЧНОГО ПРЕПАРАТА (С ТОЧНО ТАКИМ ЖЕ ДЕЙСТВУЮЩИМ ВЕЩЕСТВОМ, В ТАКОЙ ЖЕ ДОЗИРОВКЕ), НО ДРУГОГО ПРОИЗВОДИТЕЛЯ.</strong></p>\r\n<p>Существует несколько групп препаратов, которые различаются&nbsp; по химическому составу и механизму действия. Действие группы, в которую входят вещества глибенкламид (Манинил), глимепирид (Амарил), гликлазид (Диабетон) основано на стимуляции выделения инсулина клетками поджелудочной железы. Метформин угнетает образование глюкозы в печени и увеличивает чувствительность тканей к инсулину. Дополнительными его действиями являются снижение холестерина, снижает риск развития инфаркта миокарда, доказано снижает смертность у пациентов с сахарным диабетом, способствует снижению массы тела, а также может применяться при поликистозе яичников. Группа ингибиторов ДПП<sub>4</sub>, или глиптины, куда входят саксаглиптин (Онглиза), ситаглиптин (Янувия), вилдаглиптин (Галвус), препятствует разрушению ферментом ДПП<sub>4</sub> гормонов, которые стимулируют выработку инсулина в ответ на повышение уровня глюкозы в крови. Существуют также препараты, препятствующие всасыванию глюкозы (Акарбоза, препарат Глюкобай) и подавляют обратное всасывание глюкозы в почках, что приводит к ее выведению (Форсига).</p>\r\n<p>У нас в ассортименте представлены как лекарственные препараты зарубежных производителей Санофи Авентис, Ново Нордиск, Новартис, Астра Зенека, Сервье, Берлин-Хеми, Никомед, Вёрваг Фарма, Тева, Берингер Ингельхайм, так и аналоги, выпускаемые российскими производителями: Фармстандарт, Акрихин, Биосинтез, Вертекс, Озон.</p>'),(243,3,47,0,31,'Сахароснижающие лекарственные препараты, инсулин, сахарный диабет'),(244,3,48,0,31,'Таблетированные сахароснижающие препараты'),(245,3,62,0,31,NULL),(246,3,65,0,31,NULL),(249,3,44,0,32,'<p>У больных сахарным диабетом после инъекции инсулина или приема сахароснижающих препаратов в таблетках может возникать <strong>резкое снижение уровня глюкозы в крови (гипогликемия)</strong>. Такое состояние очень опасно для здоровья, и даже для жизни пациента.</p>\r\n<p>Гипогликемия имеет три степени тяжести: легкую, среднюю и тяжелую. Чем ниже опускается уровень сахара в крови, тем сильнее выражены симптомы.</p>\r\n<p>При <strong><em>легкой</em></strong> гипогликемии показания глюкометра опускаются ниже 3,8 ммоль/л. Больной ощущает необъяснимую тревогу, нервозность, тошноту, голод, его знобит, немеют кончики пальцев или губы; может появиться учащенное сердцебиение.</p>\r\n<p>Гипогликемия <strong><em>средней</em></strong> тяжести проявляется ухудшением сознания и настроения: человек тревожен, раздражителен, испытывает трудности при концентрации или мышлении. Зрение затуманивается, кружится и болит голова. Из-за слабости и нарушения координации движений человек ходит и разговаривает с трудом.</p>\r\n<p>Если уровень сахара в крови опускается ниже 2,2 ммоль/л &ndash; это признак <strong><em>тяжелой гипогликемии</em></strong>. Такое состояние может привести к эпилептическому припадку, судорогам, потере сознания и коме. Температура тела значительно снижается. <strong>При первых же признаках такого состояния человеку необходимо вызвать скорую помощь.</strong></p>\r\n<p>Бывает и так, что резкое снижение уровня глюкозы может проявиться &laquo;внешне&raquo; не сразу и не повлиять на самочувствие человека.<strong> Поэтому нужно регулярно проводить самоконтроль глюкозы крови всем людям, больным сахарным диабетом, а особенно после введения инсулина. </strong></p>\r\n<p>Больным сахарным диабетом, у которых часто бывают резкие перепады уровня глюкозы, следует всегда иметь при себе что-нибудь, содержащее &laquo;быстрые&raquo; сахара, то есть те, которые быстро расщепляются до глюкозы (например, кусочки сахара, сладкие конфеты, глюкоза в таблетках или в ампулах). Существует также препарат ГликоГен Гипокит &ndash; препарат первой помощи (применяется только по назначению врача), который может быть использован для устранения гипогликемии у человека при потере сознания, так как он вводится в виде инъекции.&nbsp; Через 10 минут после того, как были оказаны меры первой помощи человеку нужно измерить уровень глюкозы в крови.</p>\r\n<p>Не стоит забывать, что симптомы гипогликемии могут быть похожи с симптомами других заболеваний, поэтому больному обязательно необходима консультация врача.</p>'),(250,3,47,0,32,'инсулин, сахарный диабет, сахаропонижающий препарат'),(251,3,48,0,32,'Препарат первой помощи при резко пониженном уровне глюкозы в крови (тяжелой гипогликемии), который может возникать у больных сахарным диабетом после инъекции инсулина или приема таблетированных сахароснижающих препаратов.'),(252,3,62,0,32,NULL),(253,3,65,0,32,NULL),(254,3,44,0,33,'Тест-полоски для глюкометров'),(255,3,47,0,33,'тест-полоски для глюкометров, сахарный диабет, глюкометр'),(256,3,48,0,33,'Тест-полоски ─ это специальные полоски для определения различных показателей в крови или моче. Могут использоваться как со специальным прибором (например, для определения уровня глюкозы в крови - с глюкометром), так и без него (визуальные тест-полоски).'),(257,3,62,0,33,NULL),(258,3,65,0,33,NULL),(259,3,44,0,34,'<p>Для того, чтобы провести измерение уровня глюкозы в крови, необходимо проколоть палец с помощью скарификатора или ланцета, помещенного в ручку-прокалыватель для &laquo;взятия&raquo; капли крови тест-полоской. Устройства для прокалывания позволяют сделать прокол почти безболезненным, что очень важно при проведении частых измерений. В ручку помещается стерильный ланцет, настраивается глубина прокола в зависимости от толщины кожи, устройство взводится согласно инструкции, прижимается к месту будущего прокола и нажимается кнопка спуска ─ происходит прокол. Устройства для прокалывания и ланцеты входят в комплект к глюкометрам всех производителей, но могут выпускаться отдельно. Устройство для прокалывания не привязано к глюкометру, то есть в случае его поломки можно приобрести устройство любого другого производителя. Следует отметить, что ланцеты разных производителей отличаются по форме: бывают круглые, четырехгранные и плоские. Замечено, что к большинству ручек для прокалывания подходят и круглые, и четырехгранные ланцеты. К ручкам для прокалывания фирмы Акку-Чек подходят ланцеты исключительно данного производителя. Также существуют и разные типы разные типы ручек данного производителя: Акку-чек Софткликс, содержащая плоское гнездо для одноразовой ланцеты Софткликс, и ручка Акку-чек Мультиликс в которой используются ланцеты, помещенные в специальный барабан, который вставляется в гнездо ручки.&nbsp;</p>'),(260,3,47,0,34,'ланцеты, прокалыватели, сахарный диабет, глюкометр, инсулин, инсулиновая помпа'),(261,3,48,0,34,'Для того, чтобы провести измерение уровня глюкозы в крови, необходимо проколоть палец с помощью скарификатора или ланцета, помещенного в ручку-прокалыватель для «взятия» капли крови тест-полоской. '),(262,3,62,0,34,NULL),(263,3,65,0,34,NULL);

