1,0,0,NULL,'_-_-_-_-_.jpg'),(21,29,'2015-06-30 18:29:38','2015-07-07 18:12:03','1/3/29/21',4,3,0,1,'Инсулиновые помпы и расходные материалы',1,'insulinovye-pompy-i-rashodnye-materialy',NULL,'_-__11.jpg',NULL,NULL,NULL,'PRODUCTS_AND_PAGE',NULL,1,NULL,NULL,NULL,'diabetcare/insulinovye-pompy-i-rashodnye-materialy.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'_-__10.jpg'),(22,29,'2015-06-30 18:32:13','2015-07-07 17:58:52','1/3/29/22',5,3,0,1,'Инсулиновые шприц-ручки',1,'insulinovye-shpric-ruchki',NULL,'_-__7.jpg','Инсулиновые шприц-ручки',NULL,NULL,'PRODUCTS_AND_PAGE',NULL,1,NULL,NULL,NULL,'diabetcare/insulinovye-shpric-ruchki.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'_-__6.jpg'),(23,29,'2015-06-30 18:33:37','2015-07-07 18:06:25','1/3/29/23',6,3,0,1,'Иглы для инсулиновых шприц-ручек',1,'igly-dlja-insulinovyh-shpric-ruchek',NULL,'_-_-_-__3.jpg','Иглы для инсулиновых шприц-ручек',NULL,NULL,'PRODUCTS_AND_PAGE',NULL,0,NULL,NULL,NULL,'diabetcare/igly-dlja-insulinovyh-shpric-ruchek.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'_-_-_-__2.jpg'),(24,29,'2015-06-30 18:36:22','2015-07-07 18:47:35','1/3/29/24',7,3,0,1,'Шприцы инсулиновые',1,'shpricy-insulinovye',NULL,'13985_0_1.jpg',NULL,NULL,NULL,'PRODUCTS_AND_PAGE',NULL,1,NULL,NULL,NULL,'diabetcare/shpricy-insulinovye.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'13985_0.jpg'),(25,29,'2015-06-30 18:37:23','2015-07-07 18:00:55','1/3/29/25',8,3,0,1,'Биологически активные добавки',1,'biologicheski-aktivnye-dobavki',NULL,'file_5.jpg',NULL,NULL,NULL,'PRODUCTS_AND_PAGE',NULL,1,NULL,NULL,NULL,'diabetcare/biologicheski-aktivnye-dobavki.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'file_4.jpg'),(26,29,'2015-06-30 18:38:04','2015-07-07 18:01:25','1/3/29/26',9,3,0,1,'Гигиенические средства',1,'gigienicheskie-sredstva',NULL,'file_7.jpg',NULL,NULL,NULL,'PRODUCTS_AND_PAGE',NULL,1,NULL,NULL,NULL,'diabetcare/gigienicheskie-sredstva.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'file_6.jpg'),(27,19,'2015-06-30 18:53:08','2015-07-12 15:25:20','1/3/29/19/27',1,4,0,1,'Глюкометры',1,'gljukometry','<p>Для всех людей с диагнозом &laquo;сахарный диабет&raquo; необходимо проводить контроль уровня глюкозы в крови. Только при проведении самоконтроля возможно назначение врачом правильного лечения, внесение изменнений в рацион питания и достижение стабильной компенсации сахарного диабета.</p><p class=\"message bg-info text-info\">Прибор, с помощью которого можно быстро и точно измерить уровень глюкозы в крови называется <a href=\"martana.su\">глюкометр</a>. В настоящее время это самый лучший способ самоконтроля.Существует несколько методик измерения по принципу действия глюкометров:</p>\r\n<ul>\r\n<li>&nbsp;<a href=\"martana.su\">Фотометрический</a>, который основан на определении изменения интенсивности окраски цветового контрольного окна тест-полоски, возникающего в результате взаимодействия глюкозы крови и специального реагента, нанесенного на тест-полоску. После изменения интенсивности окраски контрольного поля тест-полоски показатель преобразуется в значение, которое выводится на дисплей.</li>\r\n<li><a href=\"martana.su\">Электрохимический</a>, который основан на измерении уровня глюкозы в крови в соответствии с величиной силы тока или изменении заряда электронов, которые появляются в результате взаимодействия глюкозы крови и реагента тест-полоски.</li>\r\n</ul>\r\n<p>Глюкометры также могут различаться по калибровке (по плазме или по цельной крови) и по способу кодирования прибора, способу нанесения капли крови на тест-полоску.</p>\r\n<p>В дополнение к каждому глюкометру идут ручки-скарификаторы для прокалывания пальца, комплект одноразовых ланцетов, к большинству глюкометров в комплекте содержится 10 тест-полосок. Каждый производитель производит к своему глюкометру уникальные тест-полоски, которые совместимы только с конкретной моделью глюкометра данного производителя.</p>\r\n<p>Кроме уровня глюкозы в крови, всем людям, больным сахарным диабетом необходимо измерять:</p>\r\n<ul>\r\n<li>уровень кетоновых тел;</li>\r\n<li>холестерин (некоторые глюкометры приспособлены для измерения этих параметров);</li>\r\n<li>уровень гликированного гемоглобина, который рекомендуется измерять не реже одного раза в три месяца.</li>\r\n</ul>\r\n<p>Существует несколько методов определения гликированного гемоглобина: хроматографические, колориметрические и иммунохимические. Все они проводятся в лабораториях при помощи дорогостоящих приборов. Для медицинских лабораторий у нас имеются <a href=\"martana.su\">специальные предложения</a>.&nbsp;</p>\r\n<p>В нашей аптеке представлены глюкометры следующих производителей: Roche Diagnostics GmbH, Германия, Johnson &amp; Johnson (США), Abbott (США), Бионайм (Швейцария), Байер (Bayer), Элта, Россия, 77 Elektronika Kft, Венгрия</p>','no-photo_25.jpg','Глюкометры','глюкометры,сахарный диабет, инсулин, средства контроля, холестирин, глюкоза в крови','глюкометры, контроль уровня глюкозы в крови','PRODUCTS_AND_PAGE',NULL,1,NULL,NULL,NULL,'diabetcare/sredstva-kontrolja/gljukometry.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'no-photo_24.jpg'),(28,19,'2015-06-30 18:54:45','2015-07-22 17:40:55','1/3/29/19/28',2,4,0,1,'Визуальные тест полоски',1,'test-poloski','<p class=\"message bg-info text-info\">Визуальные тест-полоски используются для качественного и полуколичественного анализа различных показателей без прибора:</p>\r\n<ul>\r\n<li>&nbsp;Уровня глюкозы в крови (например, тест-полоски Бетачек);</li>\r\n</ul>\r\n<p>При помощи визуальных тест-полосок возможно определение следующих показателей в моче:</p>\r\n<ul>\r\n<li>Уровня глюкозы (тест-полоски Уриглюк);</li>\r\n<li>Кетоновых тел (тест-полоски Урикет);</li>\r\n<li>Белка (тест-полоски Урибел);</li>\r\n<li>pH (тест-полоски Ури- pH);</li>\r\n<li>Тест-полоски, в которых совмещено определение глюкозы и кетоновых тел.</li>\r\n</ul>\r\n<p>Визуальные тест-полоски могут быть использованы в медицинских учреждениях и в домашних условиях. В основе полуколичественного метода лежит взаимодействие активного вещества и реагента, нанесенного на тест-полоску, изменение цвета полоски и интенсивности ее окраски, которая затем сравнивается с эталоном на цветовой шкале, нанесенной на упаковку.</p>\r\n<p>Метод дает возможность контролировать различные показатели в биологических жидкостях, контролировать ход лечения, а также подобрать соответствующую диету.</p>','no-photo_27.jpg','Глюкометры','тест-полоски, уровень глюкозы в крови, сахарный диабет, диета','тест-полоски, измерение уровня глюкозы в крови','PRODUCTS_AND_PAGE',NULL,1,NULL,NULL,NULL,'diabetcare/sredstva-kontrolja/test-poloski.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'no-photo_26.jpg'),(29,3,'2015-07-05 12:43:15','2015-07-05 12:49:39','1/3/29',1,2,16,1,'Diabetcare',1,'diabetcare',NULL,NULL,NULL,NULL,NULL,'PRODUCTS_AND_PAGE',NULL,0,NULL,NULL,NULL,'diabetcare.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,NULL),(30,18,'2015-07-09 18:06:38','2015-07-16 15:05:56','1/3/29/18/30',1,4,0,1,'Инсулины',1,'insuliny','<p>Инсулин &ndash; лекарственный препарат, который применяется для замещения недостатка выработки гормона поджелудочной железы. Введение препаратов инсулина в настоящее время является единственным способом устранения его абсолютной недостаточности при разрушении клеток поджелудочной железы.</p>\r\n<p><strong>ПРЕПАРАТЫ ИНСУЛИНА ДОЛЖНЫ ПРИНИМАТЬСЯ ТОЛЬКО ПО НАЗНАЧЕНИЮ ВРАЧА. </strong></p>\r\n<p><strong>НИ В КОЕМ СЛУЧАЕ НЕ СЛЕДУЕТ РЕКОМЕНДОВАТЬ ПРЕПАРАТЫ ИНСУЛИНА СВОИМ РОДСТВЕННИКАМ, ДРУЗЬЯМ, ИЛИ ЗНАКОМЫМ. НЕЛЬЗЯ ИЗМЕНЯТЬ ДОЗИРОВКУ ИНСУЛИНА САМОСТОЯТЕЛЬНО, БЕЗ КОНСУЛЬТАЦИИ ПАЦИЕНТА С ВРАЧОМ. СМЕНА ДОЗИРОВКИ ИНСУЛИНА ДОЛГО МОЖЕТ НЕ ПРОЯВЛЯТЬСЯ &laquo;ВНЕШНЕ&raquo;, ТО ЕСТЬ ЧЕЛОВЕК МОЖЕТ НЕ ЗАМЕЧАТЬ ИЗМЕНЕНИЙ СОСТОЯНИЯ ОРГАНИЗМА,&nbsp; ОДНАКО ЭТО ОБЯЗАТЕЛЬНО ОТРАЗИТСЯ НА ПОКАЗАТЕЛЯХ В КРОВИ.</strong></p>\r\n<p><strong>ФАРМАЦЕВТ НЕ МОЖЕТ ПРИНЯТЬ РЕШЕНИЕ О НАЗНАЧЕНИИ ИНСУЛИНА, ИЗМЕНЕНИИ ДОЗИРОВКИ ИЛИ ЗАМЕНЫ ПРЕПАРАТА ИНСУЛИНА. В САМЫХ КРАЙНИХ СЛУЧАЯХ, КОГДА ПАЦИЕНТУ СРОЧНО НУЖЕН ИНСУЛИН, ВОЗМОЖЕН ПОДБОР АНАЛОГИЧНОГО ПРЕПАРАТА ИНСУЛИНА (С ТОЧНО ТАКИМ ЖЕ ДЕЙСТВУЮЩИМ ВЕЩЕСТВОМ), НО ДРУГОГО ПРОИЗВОДИТЕЛЯ.</strong></p>\r\n<p><strong>&nbsp;ПРИОБРЕТАЯ У НАС ПРЕПАРАТЫ ИНСУЛИНА, ВЫ МОЖЕТЕ БЫТЬ УВЕРЕНЫ, ЧТО ОНИ ХРАНИЛИСЬ ПРИ ПОЛНОМ СОБЛЮДЕНИИ ТЕМПЕРАТУРНОГО РЕЖИМА. МЫ ГАРАНТИРУЕМ, ЧТО ТРАНСПОРТИРОВКА ПРЕПАРАТОВ ИНСУЛИНА ПРОВОДИТСЯ С ПОЛНЫМ СОБЛЮДЕНИЕМ </strong><a href=\"martana.su\"><strong>ХОЛОДОВОЙ ЦЕПОЧКИ</strong></a><strong>.</strong></p>\r\n<p>Препараты инсулина различаются по происхождению, по длительности действия и по степени очистки. В настоящее время используются препараты так называемого человеческого инсулина, полученные методом генной инженерии и его синтетические аналоги. В нашей аптеке представлены инсулины производителей Ново Нордиск, Эли Лилли, Фармстандарт и Санофи Авентис. Выбор инсулина, его дозировки и способа введения должен быть индивидуальным и осуществляться лечащим врачом.</p>','file_9.jpg','Инсулины','инсулин, сахарный диабет, глюкоза','Инсулин – лекарственный препарат, который применяется для замещения недостатка выработки гормона поджелудочной железы. ','PRODUCTS_AND_PAGE',NULL,0,NULL,NULL,NULL,'diabetcare/lekarstvennye-preparaty/insuliny.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'file_8.jpg'),(31,18,'2015-07-09 18:11:47','2015-07-09 18:11:47','1/3/29/18/31',2,4,0,1,'Таблетированные сахароснижающие препараты',1,'tabletirovannye-saharosnizhajuschie-preparaty','<p>Сахароснижающие лекарственные препараты, которые выпускаются в виде таблеток, применяются для лечения сахарного диабета только 2 типа.</p>\r\n<p><strong>ВСЕ САХАРОСНИЖАЮЩИЕ ПРЕПАРАТЫ В ТАБЛЕТКАХ ДОЛЖНЫ ПРИМЕНЯТЬСЯ ТОЛЬКО ПО НАЗНАЧЕНИЮ ВРАЧА.</strong></p>\r\n<p><strong>НЕ СЛЕДУЕТ РЕКОМЕНДОВАТЬ ТАБЛЕТИРОВАННЫЕ САХАРОСНИЖАЮЩИЕ ПРЕПАРАТЫ СВОИМ РОДСТВЕННИКАМ, ДРУЗЬЯМ, ИЛИ ЗНАКОМЫМ. </strong></p>\r\n<p><strong>ФАРМАЦЕВТ НЕ МОЖЕТ ПРИНЯТЬ РЕШЕНИЕ О НАЗНАЧЕНИИ САХАРОСНИЖАЮЩЕГО ПРЕПАРАТА В ТАБЛЕТКАХ, ИЗМЕНЕНИИ ДОЗИРОВКИ ИЛИ ЕГО ЗАМЕНЫ. ВОЗМОЖЕН ТОЛЬКО ЛИШЬ ПОДБОР АНАЛОГИЧНОГО ПРЕПАРАТА (С ТОЧНО ТАКИМ ЖЕ ДЕЙСТВУЮЩИМ ВЕЩЕСТВОМ, В ТАКОЙ ЖЕ ДОЗИРОВКЕ), НО ДРУГОГО ПРОИЗВОДИТЕЛЯ.</strong></p>\r\n<p>Существует несколько групп препаратов, которые различаются&nbsp; по химическому составу и механизму действия. Действие группы, в которую входят вещества глибенкламид (Манинил), глимепирид (Амарил), гликлазид (Диабетон) основано на стимуляции выделения инсулина клетками поджелудочной железы. Метформин угнетает образование глюкозы в печени и увеличивает чувствительность тканей к инсулину. Дополнительными его действиями являются снижение холестерина, снижает риск развития инфаркта миокарда, доказано снижает смертность у пациентов с сахарным диабетом, способствует снижению массы тела, а также может применяться при поликистозе яичников. Группа ингибиторов ДПП<sub>4</sub>, или глиптины, куда входят саксаглиптин (Онглиза), ситаглиптин (Янувия), вилдаглиптин (Галвус), препятствует разрушению ферментом ДПП<sub>4</sub> гормонов, которые стимулируют выработку инсулина в ответ на повышение уровня глюкозы в крови. Существуют также препараты, препятствующие всасыванию глюкозы (Акарбоза, препарат Глюкобай) и подавляют обратное всасывание глюкозы в почках, что приводит к ее выведению (Форсига).</p>\r\n<p>У нас в ассортименте представлены как лекарственные препараты зарубежных производителей Санофи Авентис, Ново Нордиск, Новартис, Астра Зенека, Сервье, Берлин-Хеми, Никомед, Вёрваг Фарма, Тева, Берингер Ингельхайм, так и аналоги, выпускаемые российскими производителями: Фармстандарт, Акрихин, Биосинтез, Вертекс, Озон.</p>','_-__13.jpg','Таблетированные сахароснижающие препараты','Сахароснижающие лекарственные препараты, инсулин, сахарный диабет','Таблетированные сахароснижающие препараты','PRODUCTS_AND_PAGE',NULL,0,NULL,NULL,NULL,'diabetcare/lekarstvennye-preparaty/tabletirovannye-saharosnizhajuschie-preparaty.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'_-__12.jpg'),(32,18,'2015-07-09 18:30:46','2015-07-09 18:32:37','1/3/29/18/32',3,4,0,1,'Первая помощь при резко пониженном уровне сахара',1,'pervaja-pomosch-pri-rezko-ponizhennom-urovne-sahara','<p>У больных сахарным диабетом после инъекции инсулина или приема сахароснижающих препаратов в таблетках может возникать <strong>резкое снижение уровня глюкозы в крови (гипогликемия)</strong>. Такое состояние очень опасно для здоровья, и даже для жизни пациента.</p>\r\n<p>Гипогликемия имеет три степени тяжести: легкую, среднюю и тяжелую. Чем ниже опускается уровень сахара в крови, тем сильнее выражены симптомы.</p>\r\n<p>При <strong><em>легкой</em></strong> гипогликемии показания глюкометра опускаются ниже 3,8 ммоль/л. Больной ощущает необъяснимую тревогу, нервозность, тошноту, голод, его знобит, немеют кончики пальцев или губы; может появиться учащенное сердцебиение.</p>\r\n<p>Гипогликемия <strong><em>средней</em></strong> тяжести проявляется ухудшением сознания и настроения: человек тревожен, раздражителен, испытывает трудности при концентрации или мышлении. Зрение затуманивается, кружится и болит голова. Из-за слабости и нарушения координации движений человек ходит и разговаривает с трудом.</p>\r\n<p>Если уровень сахара в крови опускается ниже 2,2 ммоль/л &ndash; это признак <strong><em>тяжелой гипогликемии</em></strong>. Такое состояние может привести к эпилептическому припадку, судорогам, потере сознания и коме. Температура тела значительно снижается. <strong>При первых же признаках такого состояния человеку необходимо вызвать скорую помощь.</strong></p>\r\n<p>Бывает и так, что резкое снижение уровня глюкозы может проявиться &laquo;внешне&raquo; не сразу и не повлиять на самочувствие человека.<strong> Поэтому нужно регулярно проводить самоконтроль глюкозы крови всем людям, больным сахарным диабетом, а особенно после введения инсулина. </strong></p>\r\n<p>Больным сахарным диабетом, у которых часто бывают резкие перепады уровня глюкозы, следует всегда иметь при себе что-нибудь, содержащее &laquo;быстрые&raquo; сахара, то есть те, которые быстро расщепляются до глюкозы (например, кусочки сахара, сладкие конфеты, глюкоза в таблетках или в ампулах). Существует также препарат ГликоГен Гипокит &ndash; препарат первой помощи (применяется только по назначению врача), который может быть использован для устранения гипогликемии у человека при потере сознания, так как он вводится в виде инъекции.&nbsp; Через 10 минут после того, как были оказаны меры первой помощи человеку нужно измерить уровень глюкозы в крови.</p>\r\n<p>Не стоит забывать, что симптомы гипогликемии могут быть похожи с симптомами других заболеваний, поэтому больному обязательно необходима консультация врача.</p>','_-__15.jpg','Первая помощь при резко пониженном уровне сахара','инсулин, сахарный диабет, сахаропонижающий препарат','Препарат первой помощи при резко пониженном уровне глюкозы в крови (тяжелой гипогликемии), который может возникать у больных сахарным диабетом после инъекции инсулина или приема таблетированных сахароснижающих препаратов.','PRODUCTS_AND_PAGE',NULL,0,NULL,NULL,NULL,'diabetcare/lekarstvennye-preparaty/pervaja-pomosch-pri-rezko-ponizhennom-urovne-sahara.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'_-__14.jpg'),(33,20,'2015-07-13 17:36:38','2015-07-14 19:57:13','1/3/29/20/33',1,4,0,1,'Тест-полоски для глюкометров',1,'test-poloski-dlja-gljukometrov','Тест-полоски для глюкометров','no-photo_39.jpg','Тест-полоски для глюкометров','тест-полоски для глюкометров, сахарный диабет, глюкометр','Тест-полоски ─ это специальные полоски для определения различных показателей в крови или моче. Могут использоваться как со специальным прибором (например, для определения уровня глюкозы в крови - с глюкометром), так и без него (визуальные тест-полоски).','PRODUCTS_AND_PAGE',NULL,0,NULL,NULL,NULL,'diabetcare/rashodnye-materialy-k-sredstvam-kontrolja/test-poloski-dlja-gljukometrov.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'no-photo_38.jpg'),(34,20,'2015-07-13 17:38:57','2015-07-14 19:58:37','1/3/29/20/34',2,4,0,1,'Ланцеты и прокалыватели',1,'lancety-i-prokalyvateli','<p>Для того, чтобы провести измерение уровня глюкозы в крови, необходимо проколоть палец с помощью скарификатора или ланцета, помещенного в ручку-прокалыватель для &laquo;взятия&raquo; капли крови тест-полоской. Устройства для прокалывания позволяют сделать прокол почти безболезненным, что очень важно при проведении частых измерений. В ручку помещается стерильный ланцет, настраивается глубина прокола в зависимости от толщины кожи, устройство взводится согласно инструкции, прижимается к месту будущего прокола и нажимается кнопка спуска ─ происходит прокол. Устройства для прокалывания и ланцеты входят в комплект к глюкометрам всех производителей, но могут выпускаться отдельно. Устройство для прокалывания не привязано к глюкометру, то есть в случае его поломки можно приобрести устройство любого другого производителя. Следует отметить, что ланцеты разных производителей отличаются по форме: бывают круглые, четырехгранные и плоские. Замечено, что к большинству ручек для прокалывания подходят и круглые, и четырехгранные ланцеты. К ручкам для прокалывания фирмы Акку-Чек подходят ланцеты исключительно данного производителя. Также существуют и разные типы разные типы ручек данного производителя: Акку-чек Софткликс, содержащая плоское гнездо для одноразовой ланцеты Софткликс, и ручка Акку-чек Мультиликс в которой используются ланцеты, помещенные в специальный барабан, который вставляется в гнездо ручки.&nbsp;</p>','no-photo_41.jpg','Ланцеты и прокалыватели','ланцеты, прокалыватели, сахарный диабет, глюкометр, инсулин, инсулиновая помпа','Для того, чтобы провести измерение уровня глюкозы в крови, необходимо проколоть палец с помощью скарификатора или ланцета, помещенного в ручку-прокалыватель для «взятия» капли крови тест-полоской. ','PRODUCTS_AND_PAGE',NULL,0,NULL,NULL,NULL,'diabetcare/rashodnye-materialy-k-sredstvam-kontrolja/lancety-i-prokalyvateli.html',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,0,NULL,'no-photo_40.jpg');

