insert  into `catalog_product_entity_text`(`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (75,4,72,0,9,'<p><strong>Технические характеристики:</strong></p>\r\n<ul>\r\n<li>Время измерения: 5 секунд</li>\r\n<li>Объем капли крови: 0,6 мкл</li>\r\n<li><a href=\"https://www.accu-chek.ru/ru/products/chernii-chip.html\">Универсальное кодирование (черный чип активации, который после первой установки больше не нужно менять)</a></li>\r\n<li>Объем памяти: 500 результатов измерений с указанием времени и даты</li>\r\n<li>Автоматическое включение/выключение прибора при введении/удалении тест-полоски</li>\r\n<li>Расчет средних значений за 7, 14, 30 и 90 дней, в том числе до и после приема пищи</li>\r\n<li>Маркировка результатов до и после еды</li>\r\n<li>Напоминания об измерении после еды</li>\r\n<li>Будильник на 4 момента времени</li>\r\n<li>Предупреждение о гипогликемии в индивидуально настраиваемом диапазоне</li>\r\n<li>Передача данных в ПК через инфракрасный порт</li>\r\n<li>Жидкокристаллический дисплей с подсветкой</li>\r\n<li>Две литиевые батарейки (CR2032)</li>\r\n<li>Длительность работы батареи: примерно 1000 измерений</li>\r\n<li>Автоматическое включение и выключение:</li>\r\n<li>Прибор отключается через 2 минуты после окончания работы</li>\r\n<li>Диапазон измерений: 0,6-33,3 ммоль/л</li>\r\n<li>Метод измерения: электрохимический</li>\r\n<li>Допустимый диапазон гематокрита: 10 &ndash; 65%</li>\r\n<li>Условия хранения: от -25&deg;C до 70&deg;C</li>\r\n<li>Рабочая температура системы: от +8&deg;C до +44&deg;C</li>\r\n<li>Рабочий диапазон относительной влажности воздуха: 10%-90%</li>\r\n<li>Рабочая высота: до 4000 м над уровнем моря</li>\r\n<li>Масса: 40 г с батарейками</li>\r\n<li>Индикатор гипогликемии</li>\r\n<li>Будильник: 4 момента времени</li>\r\n</ul>\r\n<p><strong><br /></strong></p>'),(76,4,73,0,9,'<p><span style=\"font-size: 12px;\">Маркировка результатов до и после еды</span><br /><span style=\"font-size: 12px;\">Напоминания об и