амять:&nbsp;250 измерений.</li>\r\n<li>Статистика:&nbsp;среднее значение за 14 дней.</li>\r\n<li>Диапазон измерений:&nbsp;0,6-33,3 ммоль/л</li>\r\n<li>Кодировка тест-полосок:&nbsp;автоматическая</li>\r\n<li>Пометка о еде:<strong>&nbsp;</strong>нет</li>\r\n<li>Масса:&nbsp;57 г</li>\r\n<li>Передача данных на ПК через микро-USB</li>\r\n<li>Тип батарейки:&nbsp;(cr 2032)</li>\r\n<li>Гарантия:&nbsp;5 лет</li>\r\n</ul>'),(133,4,73,0,19,'Глюкометр Контур ТС (Contour TS)'),(134,4,151,0,19,NULL),(135,4,83,0,19,NULL),(136,4,106,0,19,NULL),(137,4,72,0,20,'<p class=\"Heading11\">Технические характеристики&nbsp;</p>\r\n<ul>\r\n<li>Метод измерения: электрохимический.</li>\r\n<li>Калибровка измерения: по цельной крови.</li>\r\n<li>Объем капли крови: 1 мкл.</li>\r\n<li>Время измерения 7 сек.</li>\r\n<li>Объем памяти: 60 показанийой тест-полоски.</li>\r\n<li>Контрольнач тест-полоска в комплекте для проверки правильности работы прибора.</li>\r\n<li>Кодировка: с помощью кодировочн</li>\r\n<li>Диапазон измерений: 0,6 &ndash; 35,0 ммоль/л</li>\r\n<li>Тип батарейки:&nbsp;CR 2032</li>\r\n</ul>'),(138,4,73,0,20,'Глюкометр Сателлит-Экспресс'),(139,4,151,0,20,NULL),(140,4,83,0,20,NULL),(141,4,106,0,20,NULL),(142,4,72,0,21,'<p class=\"Heading11\">Технические характеристики &nbsp;&nbsp;</p>\r\n<ul>\r\n<li>Метод измерения:&nbsp;электрохимический</li>\r\n<li>Калибровка результата:&nbsp;по плазме крови</li>\r\n<li>Объем капли крови:&nbsp;0,7 мкл.</li>\r\n<li>Время измерения:<strong>&nbsp;</strong>6 сек.</li>\r\n<li>Память:&nbsp;250 измерений.</li>\r\n<li>Статистика:&nbsp;среднее значение за 7, 14, 21 и 28 дней.</li>\r\n<li>Наличие индикаторов&nbsp; гипогликемии (&lt;3,5 ммоль/л) и гипергликемии (&gt;9,0 ммоль/л)</li>\r\n<li>Диапазон измерений:&nbsp;1,1- 33,3 ммоль/л</li>\r\n<li>Кодировка тест-полосок:&nbsp;не требуется.</li>\r\n<li>Пометка о еде:<strong>&nbsp;</strong>нет</li>\r\n<li>Масса:&nbsp;56 г</li>\r\n<li>Передача данных на ПК через микро-USB</li>\r\n<li>Тип батарейки:&nbsp;(CR2032)</li>\r\n</ul>'),(143,4,73,0,21,'Глюкометр Диаконт'),(144,4,151,0,21,NULL),(145,4,83,0,21,NULL),(146,4,106,0,21,NULL),(147,4,72,0,22,'<p class=\"Standard\">Технические характеристики&nbsp;</p>\r\n<ul>\r\n<li>&laquo;голосовое&raquo; сопровождение для людей с пониженным зрением</li>\r\n<li>Метод измерения:&nbsp;электрохимический</li>\r\n<li>Калибровка результата:&nbsp;по цельной крови</li>\r\n<li>Объем капли крови:&nbsp;0,5 мкл.</li>\r\n<li>Время измерения:<strong>&nbsp;</strong>5 сек.</li>\r\n<li>Память:&nbsp;500 измерений</li>\r\n<li>Кодировка: с помощью кодирующей тест-полоски.</li>\r\n<li>Передача данных на компьютер через инфракрасный порт</li>\r\n<li>Масса: 64 г.</li>\r\n<li>Тип батарейки:&nbsp;(CR2032)</li>\r\n</ul>'),(148,4,73,0,22,'Глюкометр Сенсокард'),(149,4,151,0,22,NULL),(150,4,83,0,22,NULL),(151,4,106,0,22,NULL),(152,4,72,0,23,'<p>Тест-полоски индикаторные Уриглюк-1 предназначены для определения глюкозы в моче человека. Они могут быть использованы для экспресс-анализа в медицинских учреждениях и в домашних условиях.</p>\r\n<p>Полуколичественное определение глюкозы в моче дает возможность контролировать уровень глюкозы в моче, выбрать соответствующую диету, а также корректировать ход лечения.</p>\r\n<ul>\r\n<li>Тест полоска используется однократно.</li>\r\n<li>Цветная шкала на этикетке содержит 6 цветовых полей.</li>\r\n<li>При работе с полосками индикаторными следует соблюдать общие правила гигиены.</li>\r\n<li>Необходимо придерживаться инструкции по применению.</li>\r\n<li>Срок хранения &mdash; 2 года.</li>\r\n<li>Производитель Россия.</li>\r\n</ul>'),(153,4,73,0,23,'Тест-полоски Уриглюк'),(154,4,83,0,23,NULL),(155,4,106,0,23,NULL),(156,4,72,0,24,'<p>Тест полоски Урикет-1 используются для определения уровня ацетона (кетоновых тел) в моче. Тест полоски используются для самоконтроля, как дома, так и в медицинских учреждениях. Насыщенная окраска&nbsp;тест полосок определяется уровнем кетоновых тел. Содержание ацетона в моче определяется путем сравнения окраски зоны реакции тест полоски со шкалой на тубусе. Шкала содержит шесть цветовых полей (0.0; 0.5; 1.5; 4.0; 8.0 и 16.0 ммоль/л).</p>\r\n<ul>\r\n<li>В зависимости от серии и комплекта, цветная шкала тубуса может изменится.</li>\r\n<li>Тест полоска используется однократно</li>\r\n<li>Цветная шкала на этикетке содержит 6 цветовых полей</li>\r\n<li>При работе с полосками индикаторными следует соблюдать общие правила гигиены</li>\r\n<li>Необходимо придерживаться инструкции по применению.</li>\r\n<li>Срок хранения &mdash; 2 года</li>\r\n<li>Производитель Россия</li>\r\n</ul>'),(157,4,73,0,24,'Тест-полоски Урикет'),(158,4,83,0,24,NULL),(159,4,106,0,24,NULL),(160,4,151,0,24,'<p style=\"text-align: left;\">Инструкция по применению полосок индикаторных для качественного и&nbsp;полуколичественного определения кетоновых тел в моче&nbsp;Урикет-1</p>\r\n<p class=\"Heading11\" style=\"text-align: left;\" align=\"center\">НАЗНАЧЕНИЕ</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Полоски индикаторные Урикет-1 предназначены для визуального качественного или полуколичественного определения кетоновых тел в моче человека. Они могут быть использованы для экспресс-анализа уровня кетонурии в медицинских учреждениях и в домашних условиях.Полуколичественное определение кетоновых тел в моче дает возможность контролировать уровень кетонурии, выбрать соответствующую диету, а также корректировать ход лечения.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\"><strong>ВАЖНО</strong><strong>!</strong></p>\r\n<p class=\"Textbody\" style=\"text-align: left;\"><strong></strong><strong>Кетоновых тел в моче быть не должно. При малейшем появлении кетоновых тел в моче необходимо срочнообратиться&nbsp;к врачу. Чувствительность сенсорной зоны очень высокая.</strong></p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">&nbsp;ПРИНЦИП МЕТОДА</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">В основе метода определения кетоновых тел в моче лежит серия последовательных химических реакций между кетоновыми телами, нитроферрицианидом натрия и диамином, в результате которых происходит образование окрашенного соединения. Интенсивность окраски, развившейся в ходе химической реакции, определяется степенью взаимодействия нитроферрицианида натрия и диамина с кетоновыми телами и пропорциональна содержанию кетоновых тел в моче.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Сравнивая интенсивность окраски сенсорного элемента полоски с эталоном на цветной шкале, определяют содержание кетоновых тел в моче.</p>\r\n<p class=\"Heading11\" style=\"text-align: left;\" align=\"center\">ХАРАКТЕРИСТИКА И СОСТАВ</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Полоска индикаторная представляет собой полоску из пластика размером 5х(60-75) мм, выполняющую функцию подложки, на которой расположен сенсорный элемент.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Сенсорный элемент - это специальным образом обработанный материал размером 5х(3-6) мм, содержащий нитроферрицианид натрия и диамин, расположенный на расстоянии 1-2 мм от края подложки, который обеспечивает протекание химических реакций и образование окрашенного комплекса.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Полоски индикаторные поставляются в виде комплекта, который выполняется в двух вариантах в зависимости от упаковки.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Вариант А.&nbsp;&nbsp;&nbsp;&nbsp; 25, 50, 75 или 100 полосок индикаторных, упакованных в пенал с крышкой. Пенал снабжен влагопоглощающим элементом - мелкопористым силикагелем.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Вариант В.&nbsp;&nbsp;&nbsp;&nbsp; 1, 5, 10, 20, 25, 50, 75 или 100 полосок индикаторных, индивидуально упакованных в пакет из ламинированной алюминиевой фольги, содержащий пакетик с силикагелем.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Каждый комплект полосок индикаторных снабжен этикеткой и инструкцией по применению. Этикетка содержит цветную шкалу, состоящую из ряда цветовых полей, рядом с каждым из которых указана соответствующая концентрация кетоновых тел.&nbsp;</p>\r\n<p class=\"Heading11\" style=\"text-align: left;\" align=\"center\">АНАЛИТИЧЕСКИЕ ХАРАКТЕРИСТИКИ</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Диапазон определяемых концентраций кетоновых тел в моче составляет 0,0 - 16,0 ммоль/л. Цветная шкала на этикетке содержит 6 цветовых полей, соответствующих концентрациям кетоновых тел: 0,0 ммоль/л; 0,5 ммоль/л; 1,5 ммоль/л; 4,0 ммоль/л; 8,0 ммоль/л; 16,0 ммоль/л.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">&nbsp;Минимально определяемая концентрация кетоновых тел в моче составляет 0,5 ммоль/л.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">&nbsp;&nbsp;0,0&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;0,5&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1,5&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 8,0&nbsp;&nbsp;&nbsp;&nbsp;&ge;&nbsp;16.0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ммоль/л</p>\r\n<p class=\"Heading11\" style=\"text-align: left;\" align=\"center\">МЕРЫ ПРЕДОСТОРОЖНОСТИ</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Все компоненты полосок индикаторных являются нетоксичными.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Поскольку цветные шкалы различных серий комплектов полосок индикаторных могут отличаться по окраске, необходимо сравнивать окраску сенсорного элемента полоски только со шкалой той упаковки, из которой была взята полоска индикаторная.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Для сохранения активности полоски индикаторной следует избегать прикосновений руками к сенсорному элементу.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">При работе с полосками индикаторными следует соблюдать общие правила санитарии.</p>\r\n<p class=\"Heading11\" style=\"text-align: left;\" align=\"center\">ПРОВЕДЕНИЕ ОПРЕДЕЛЕНИЯ</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Для определения использовать свежесобранную (не более чем за 2 часа до анализа) в чистую посуду мочу.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Открыть пенал или вскрыть пакет, извлечь из него полоску индикаторную. (в случае пенала - немедленно плотно закрыть пенал крышкой). Через 3-5 секунд извлечь полоску и удалить избыток жидкости на сенсорном элементе резким движением руки, или осторожным прикосновением ребром полоски к чистой фильтровальной бумаге на 2-3 секунды, или осторожным прикосновением ребром полоски к стенке посуды с мочой. Положить полоску индикаторную на ровную чистую сухую поверхность сенсорным элементом вверх.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Через 2 минуты с момента погружения сенсорного элемента в мочу сравнить окраску сенсорного элемента с цветной шкалой на этикетке упаковки комплекта при хорошем освещении.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Изменение окраски сенсорного элемента свидетельствует о наличии кетоновых тел в моче (качественное определение). Полуколичественное определение провести путем сопоставления окраски сенсорного элемента с соответствующими цветовыми полями шкалы.</p>\r\n<p class=\"Heading11\" style=\"text-align: left;\" align=\"center\">ЧУВСТВИТЕЛЬНОСТЬ И СПЕЦИФИЧНОСТЬ ОПРЕДЕЛЕНИЯ</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Определение кетоновых тел высоко чувствительно к их наличию в моче, реагируя на их присутствие уже в концентрации 0,5 ммоль/л. Сенсорная зона имеет необходимую защиту от воздействия аскорбиновой кислоты.&nbsp; Лекарственные и диагностические препараты на основе фенолфталеина, сульфонфталеина, а также других веществ, содержащих сульфгидрильные группы, могут давать ложноположительные или ложноотрицательные результаты. Неправильные результаты могут быть вызваны недостаточной чистотой посудой для сбора мочи.</p>\r\n<p class=\"Heading11\" style=\"text-align: left;\" align=\"center\">УСЛОВИЯ ХРАНЕНИЯ И ЭКСПЛУАТАЦИИ</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Полоски индикаторные должны храниться в упаковке предприятия-изготовителя в сухом месте при температуре +10 - +30&nbsp;оС (при отсутствии паров кислот, щелочей и органических растворителей) в течение всего срока годности (24 месяца).</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Определение содержания кетоновых тел следует проводить при температуре +15-+30&nbsp;оС.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Необходимо предохранять полоски индикаторные от повышенной влажности и воздействия прямых солнечных лучей. Следует избегать попадания прямых солнечных лучей на цветную шкалу.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">Каждая полоска индикаторная предназначена для проведения одного определения содержания кетоновых тел.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\">После вскрытия пенала полоски индикаторные должны быть использованы в течение времени не более 6 месяцев.</p>\r\n<p style=\"text-align: left;\">Извлеченная из упаковки полоска индикаторная должна быть использована для проведения анализа в течение часа.</p>'),(163,4,72,0,25,'<p class=\"Textbody\">Тест полоски &nbsp;Урибел предназначены для визуального определения белка в моче человека. Они используются для экспресс-анализа уровня белка в медицинских учреждениях и в домашних условиях. Своевременное выявление&nbsp;белка в моче дает возможность контролировать уровень белка, выбрать соответствующую диету, а также корректировать ход лечения.</p>\r\n<p class=\"Textbody\">Тест обеспечивает высокую точность результата. Его&nbsp;необходимо использовать для раннего выявления различных заболеваний человека (болезни мочевыводящей системы и др.).</p>\r\n<ul>\r\n<li>Определение можно проводить: дома, на работе, в командировке, на отдыхе.&nbsp;</li>\r\n<li>Температура проведения определения от +15 до +30 градусов</li>\r\n<li>Скорость определение 60 секунд</li>\r\n<li>Цветная шкала на этикетке содержит 6 цветовых полей</li>\r\n<li>Все компоненты полосок индикаторных являются нетоксичными</li>\r\n<li>Минимально определяемая концентрация белка в моче составляет не более 0,1 г/л.</li>\r\n<li>При работе с полосками индикаторными следует соблюдать общие правила гигиены</li>\r\n<li>Необходимо придерживаться инструкции по применению.</li>\r\n<li>Срок хранения &mdash; 2 года</li>\r\n<li>Производитель Россия</li>\r\n</ul>'),(164,4,73,0,25,'Тест-полоски Урибел'),(165,4,151,0,25,'<p class=\"Textbody\" style=\"text-align: center;\">Инструкция по применению полосок индикаторных для качественного и полуколичественного определения белка в моче&nbsp;Урибел</p>\r\n<p class=\"Heading11\" align=\"center\">НАЗНАЧЕНИЕ</p>\r\n<p class=\"Textbody\">Полоски индикаторные Урибел предназначены для визуального качественного или полуколичественного определения белка в моче человека. Они могут быть использованы для экспресс-анализа уровня белка в медицинских учреждениях и в домашних условиях.</p>\r\n<p class=\"Textbody\">Полуколичественное определение белка в моче дает возможность контролировать уровень белка, выбрать соответствующую диету, а также корректировать ход лечения.</p>\r\n<p class=\"Textbody\"><strong>ВАЖНО</strong><strong>!</strong><strong>&nbsp;Для здоровых людей!!!</strong></p>\r\n<p class=\"Textbody\"><strong>Белка в моче быть не должно. При постоянном (несколько дней) малейшем появлении белка в моче необходимо срочно&nbsp;обратиться&nbsp;к врачу. Чувствительность сенсорной зоны очень высокая.</strong><strong></strong></p>\r\n<p class=\"Heading11\" align=\"center\">ПРИНЦИП МЕТОДА</p>\r\n<p class=\"Textbody\">В основе метода определения лежит метод химических рН индикаторов. В зависимости от количества белка в моче изменяется константа диссоциации, а, соответственно, и интенсивность окраски. Интенсивность окраски пропорциональна содержанию белка в моче.</p>\r\n<p class=\"Textbody\">Сравнивая интенсивность окраски с эталоном на цветной шкале, оценивают содержание белка в моче.</p>\r\n<p class=\"Heading11\" align=\"center\">ХАРАКТЕРИСТИКА И СОСТАВ</p>\r\n<p class=\"Textbody\">Полоска индикаторная представляет собой полоску из пластика размером 5х(60-75) мм, выполняющую функцию подложки, на которой расположен сенсорный элемент.</p>\r\n<p class=\"Textbody\">&nbsp;Сенсорный элемент - это специальным образом обработанный материал размером 5х(3-6) мм, содержащий рН индикатор, расположенный на расстоянии 1-2 мм от края подложки, который обеспечивает протекание реакций и образование окрашенного комплекса.</p>\r\n<p class=\"Textbody\">Полоски индикаторные поставляются в виде комплекта, который выполняется в двух вариантах в зависимости от упаковки.</p>\r\n<p class=\"Textbody\">Вариант А.&nbsp;&nbsp;&nbsp;&nbsp; 25, 50, 75 или 100 полосок индикаторных, упакованных в пенал с крышкой. Пенал снабжен влагопоглощающим элементом - мелкопористым силикагелем.</p>\r\n<p class=\"Textbody\">Вариант В.&nbsp;&nbsp;&nbsp;&nbsp; 1, 5, 10, 20, 25, 50, 75 или 100 полосок индикаторных, индивидуально упакованных в пакет из ламинированной алюминиевой фольги, содержащий пакетик с силикагелем.</p>\r\n<p class=\"Textbody\">Каждый комплект полосок индикаторных снабжен этикеткой и инструкцией по применению. Этикетка содержит цветную шкалу, состоящую из ряда цветовых полей, рядом с каждым из которых указана соответствующая концентрация белка.</p>\r\n<p class=\"Heading11\" align=\"center\">АНАЛИТИЧЕСКИЕ ХАРАКТЕРИСТИКИ</p>\r\n<p class=\"Textbody\">Диапазон определяемых концентраций белка в моче составляет 0,0&ndash;10,0 г/л. Цветная шкала на этикетке содержит 6 цветовых полей, соответствующих концентрациям белка: 0,0 г/л; 0,1 г/л; 0,3 г/л; 1,0 г/л; 3,0 г/л и 10 г/л.</p>\r\n<p class=\"Textbody\">Минимально определяемая концентрация белка в моче составляет не более 0,1 г/л.</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp;&nbsp;0,0&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;0,1&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;0,3&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&ge;&nbsp;&nbsp;10,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;г/л</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp; 0,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 30&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; 100&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;300&nbsp;&nbsp;&nbsp;&nbsp;&ge;&nbsp;1000&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;мг/дл&nbsp;&nbsp;&nbsp;</p>\r\n<p class=\"Textbody\">&nbsp;</p>\r\n<p class=\"Heading11\" align=\"center\">МЕРЫ ПРЕДОСТОРОЖНОСТИ</p>\r\n<p class=\"Textbody\">Все компоненты полосок индикаторных являются нетоксичными.</p>\r\n<p class=\"Textbody\">Поскольку цветные шкалы различных серий комплектов полосок индикаторных могут отличаться по окраске, необходимо сравнивать окраску сенсорного элемента полоски только со шкалой той упаковки, из которой была взята полоска индикаторная.</p>\r\n<p class=\"Textbody\">Для сохранения активности полоски индикаторной следует избегать прикосновений руками к сенсорному элементу.</p>\r\n<p class=\"Textbody\">При работе с полосками индикаторными следует соблюдать общие правила санитарии.</p>\r\n<p class=\"Heading11\" align=\"center\">ПРОВЕДЕНИЕ ОПРЕДЕЛЕНИЯ</p>\r\n<p class=\"Textbody\">Для обследования использовать свежесобранную (не более чем за 2 часа до анализа) в чистую посуду мочу, не центрифугированную и тщательно перемешанную.</p>\r\n<p class=\"Textbody\">Открыть пенал или вскрыть пакет, извлечь из него полоску индикаторную. В случае упаковки полосок индикаторных в пенал последний немедленно плотно закрыть крышкой.&nbsp;Погрузить сенсорный элемент полоски полностью в мочу. Через 1-2 секунды извлечь полоску и удалить избыток жидкости на сенсорном элементе резким движением руки, или осторожным прикосновением ребром полоски к чистой фильтровальной бумаге на 2-3 секунды, или осторожным прикосновением ребром полоски к стенке посуды с мочой.&nbsp;Положить полоску индикаторную на ровную чистую сухую поверхность сенсорным элементом вверх.</p>\r\n<p class=\"Textbody\">Через 1 минуту с момента погружения сенсорного элемента в мочу сравнить окраску сенсорного элемента с цветной шкалой на этикетке упаковки комплекта при хорошем освещении.</p>\r\n<p class=\"Textbody\">Изменение окраски сенсорного элемента свидетельствует о наличии белка в моче (качественное определение). Полуколичественное определение провести путем сопоставления окраски сенсорного элемента с соответствующими цветовыми полями шкалы.</p>\r\n<p class=\"Heading11\" align=\"center\">ЧУВСТВИТЕЛЬНОСТЬ И СПЕЦИФИЧНОСТЬ ОПРЕДЕЛЕНИЯ</p>\r\n<p class=\"Textbody\">Определение белка высоко чувствительно к наличию альбумина, реагируя на его присутствие в моче уже в концентрации от 0,1 г/л; чувствительность к глобулинам, мукопротеинам, гемоглобину и белкам Бенс-Джонсона намного ниже. На определение белка не влияет величина рН мочи, но в экстремально щелочной моче (с рН выше 8) или в моче с исключительно высокой буферной емкостью полоски индикаторные могут давать ложноположительные реакции и при отсутствии белка; в таких случаях мочу следует подкислить несколькими каплями уксусной кислоты до рН 5-6 и повторить определение с использованием новой полоски индикаторной. Ложноположительные результаты может давать моча пациентов, принимавших хининовые препараты или лекарства на базе производных хинолина. Ложноположительные результаты могут быть вызваны также недостаточной чистотой посуды для сбора мочи, а также со следами дезинфицирующих средств. И наоборот, неионогенные и анионактивные детергенты могут быть причиной заниженных или ложноотрицательных результатов.</p>\r\n<p class=\"Heading11\" align=\"center\">УСЛОВИЯ ХРАНЕНИЯ И ЭКСПЛУАТАЦИИ</p>\r\n<p class=\"Textbody\">Полоски индикаторные должны храниться в упаковке предприятия-изготовителя в сухом месте при температуре +10 - +30&nbsp;оС (при отсутствии паров кислот, щелочей и органических растворителей) в течение всего срока годности (24 месяцев).</p>\r\n<p class=\"Textbody\">Определение содержания белка следует проводить при температуре +15 - +30&nbsp;оС.</p>\r\n<p class=\"Textbody\">Необходимо предохранять полоски индикаторные от повышенной влажности и воздействия прямых солнечных лучей. Следует избегать попадания прямых солнечных лучей на цветную шкалу.</p>\r\n<p class=\"Textbody\">Каждая полоска индикаторная предназначена для проведения одного определения содержания белка.</p>\r\n<p class=\"Textbody\">После вскрытия пенала полоски индикаторные должны быть использованы в течение времени не более 5 месяцев.</p>\r\n<p class=\"Textbody\">Извлеченная из упаковки полоска индикаторная должна быть использована для проведения анализа в течение часа.</p>\r\n<p class=\"Textbody\">Каждый раз после извлечения полоски индикаторной из пенала последний следует немедленно и плотно закрыть крышкой.</p>\r\n<p class=\"Textbody\">Для получения надежных результатов необходимо строгое соблюдение инструкции по применению.</p>\r\n<p>По вопросам, касающимся качества полосок индикаторных для качественного и&nbsp; полуколичественного определения белка в моче &laquo;Урибел&raquo; обращаться в ООО &laquo;Биосенсор АН&raquo;: 142432, Московская обл., г. Черноголовка, а/я 4, тел/факс: +7(496) 522-16-08, 522-11-41, 522-15-89.</p>'),(166,4,83,0,25,NULL),(167,4,106,0,25,NULL),(168,4,72,0,26,'<p class=\"Standard\">Тест-полоски Кетоглюк предназначены для &nbsp;визуального определения глюкозы и кетоновых тел в моче человека.&nbsp;Это делается для того, чтобы не допустить осложнения гипергликемии &ndash; кетоацидоз. Тест-полоски Кетоглюк&nbsp;позволяют одновременно исследовать мочу человека &nbsp;на содержание глюкозы и на содержание кетоновых тел в моче.&nbsp;Визуальный анализ&nbsp;относится к разряду качественных или полуколичественных анализов. Результат анализа, позволяет корректировать лечение и выбрать подходящую диету. Кетоглюк можно использовать на работе, дома, на отдыхе, в командировке. Для того, чтобы диагностика была правильной, следует придерживаться &nbsp;правилам хранения тест полосок Кетоглюк.</p>\r\n<ul>\r\n<li>Цветная шкала тубуса, в зависимости от серии и комплекта, может различаться.</li>\r\n<li>Цветная шкала на этикетке содержит 6 цветовых полей</li>\r\n<li>Минимально определяемая концентрация глюкозы в моче составляет не более 0,05 % (2,8 ммоль/л)</li>\r\n<li>Срок хранения &mdash; 2 года</li>\r\n<li>Производитель Россия</li>\r\n</ul>'),(169,4,73,0,26,'Тест-полоски Кетоглюк'),(170,4,151,0,26,'<p class=\"Textbody\" style=\"text-align: center;\">Инструкцияпо применению тест-полосок для определения глюкозы и кетоновых тел в моче Кетоглюк&nbsp;</p>\r\n<p class=\"Textbody\" align=\"center\"><strong>&nbsp;НАЗНАЧЕНИЕ</strong></p>\r\n<p class=\"Textbody\" align=\"center\">&nbsp;Полоски индикаторные КЕТОГЛЮК-1 предназначены для одновременного визуального качественного или полуколичественного определения глюкозы и кетоновых тел в моче&nbsp; человека. Они могут быть использованы для экспресс-анализа уровня глюкозурии и кетонурии в медицинских учреждениях и в домашних условиях.</p>\r\n<p class=\"Textbody\">Полуколичественное определение глюкозы и кетоновых тел в моче дает возможность контролировать уровень глюкозурии и кетонурии, выбрать соответствующую диету, а также корректировать ход лечения.</p>\r\n<p class=\"Textbody\"><strong>ВАЖНО&nbsp;ЗНАТЬ</strong><strong>!</strong></p>\r\n<p class=\"Textbody\"><strong>Глюкозы в моче быть не должно. При малейшем появлении глюкозы необходимо срочно&nbsp;обратиться&nbsp;к врачу. Чувствительность сенсорной зоны очень высокая. Самый чувствительный тест в мире (см. п.п. \"Чувствительность и специфичность\").</strong></p>\r\n<p class=\"Textbody\"><strong></strong><strong>Кетоновых тел в моче быть не должно. При малейшем появлении кетоновых тел в моче необходимо срочнообратиться&nbsp;к врачу. Чувствительность сенсорной зоны очень высокая.</strong></p>\r\n<p class=\"Textbody\" align=\"center\"><strong>ПРИНЦИП МЕТОДА</strong></p>\r\n<p class=\"Textbody\" style=\"text-align: left;\" align=\"center\">&nbsp;В основе метода определения кетоновых тел в моче лежит серия последовательных химических реакций между кетоновыми телами, нитроферрицианидом натрия и диамином, в результате которых происходит образование окрашенного соединения. Интенсивность окраски, развившейся в ходе химической реакции, определяется степенью взаимодействия нитроферрицианида натрия и диамина с кетоновыми телами и пропорциональна содержанию кетоновых тел в моче.</p>\r\n<p class=\"Textbody\">Сравнивая интенсивность окраски сенсорного элемента полоски с эталоном на цветной шкале, определяют содержание кетоновых тел в моче.</p>\r\n<p class=\"Textbody\">В основе метода определения глюкозы лежит специфическая ферментативная реакция окисления глюкозы до глюконовой кислоты и перекиси водорода. Под действием последней в присутствии фермента пероксидазы происходит окисление хромогена и образование окрашенного соединения. Степень превращения хромогена, а, следовательно, и интенсивность окраски, пропорциональна содержанию глюкозы в исследуемой моче.</p>\r\n<p class=\"Textbody\">Сравнивая интенсивность окраски хромогена с эталоном на цветной шкале, определяют содержание глюкозы в моче.</p>\r\n<p class=\"Textbody\" align=\"center\">&nbsp;<strong>ХАРАКТЕРИСТИКА И СОСТАВ</strong></p>\r\n<p class=\"Textbody\" style=\"text-align: left;\" align=\"center\">Полоска индикаторная представляет собой полоску из пластика размером 5х(60-75) мм, выполняющую функцию подложки, на которой расположен сенсорный элемент.</p>\r\n<p class=\"Textbody\">Первый сенсорный элемент - это специальным образом обработанный материал размером 5х(3-6) мм, содержащий нитроферрицианид натрия и диамин, расположенный на расстоянии 1-2 мм от края подложки, который обеспечивает протекание химических реакций и образование окрашенного комплекса.</p>\r\n<p class=\"Textbody\">Второй сенсорный элемент - это специальным образом обработанный материал размером 5х(3-6) мм, содержащий ферменты глюкозооксидазу и пероксидазу, хромоген и стабилизаторы, расположенный на расстоянии 1-2 мм от края первого сенсорного элемента, который обеспечивает протекание реакций окисления глюкозы и хромогена и образование окрашенного комплекса.</p>\r\n<p class=\"Textbody\">Полоски индикаторные поставляются в виде комплекта, который выполняется в двух вариантах в зависимости от упаковки.</p>\r\n<p class=\"Textbody\">Вариант А.&nbsp;&nbsp;&nbsp; 25, 50, 75 или 100 полосок индикаторных, упакованных в пенал с крышкой. Пенал снабжен влагопоглощающим элементом - мелкопористым силикагелем.</p>\r\n<p class=\"Textbody\">Вариант В.&nbsp;&nbsp;&nbsp; 1, 5, 10, 20, 25, 50, 75 или 100 полосок индикаторных, индивидуально упакованных в пакет из ламинированной алюминиевой фольги, содержащий пакетик с силикагелем.</p>\r\n<p class=\"Textbody\">Каждый комплект полосок индикаторных снабжен этикеткой и инструкцией по применению. Этикетка содержит две цветные шкалы, состоящие из ряда цветовых полей, рядом с каждым из которых указана соответствующая концентрация кетоновых тел или глюкозы.</p>\r\n<p class=\"Textbody\" align=\"center\"><strong>АНАЛИТИЧЕСКИЕ ХАРАКТЕРИСТИКИ</strong></p>\r\n<p class=\"Textbody\" style=\"text-align: left;\" align=\"center\">&nbsp;Диапазон определяемых концентраций кетоновых тел в моче составляет 0,0 - 16,0 ммоль/л. Цветная шкала на этикетке содержит 6 цветовых полей, соответствующих концентрациям кетоновых тел: 0,0 ммоль/л; 0,5 ммоль/л; 1,5 ммоль/л; 4,0 ммоль/л; 8,0 ммоль/л; 16,0 ммоль/л.</p>\r\n<p class=\"Textbody\">Минимально определяемая концентрация кетоновых тел в моче составляет 0,5 ммоль/л.</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp;0,0&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;0,5&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1,5&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 8,0&nbsp;&nbsp;&nbsp;&nbsp;&ge;&nbsp;16.0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ммоль/л</p>\r\n<p class=\"Textbody\">Диапазон определяемых концентраций глюкозы в моче составляет 0,0 - 2,0 % (0,0 - 112,0 ммоль/л). Цветная шкала на этикетке содержит&nbsp;7&nbsp;цветовых полей, соответствующих концентрациям глюкозы в % (ммоль/л): 0,0 (0,0); 0,05 (2,8); 0,1 (5,6); 0,25 (14,0); 0,5 (28,0); 1,0 (56,0), [2,0 (112)].</p>\r\n<p class=\"Textbody\">Минимально определяемая концентрация глюкозы в моче по цветовой шкале составляет не более 0,05 % (2,8 ммоль/л).</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp; 0,0&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;0,05&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;0,1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;0,25&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;0,5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1,0&nbsp;&nbsp; &nbsp;&nbsp;&ge;&nbsp;&nbsp;&nbsp;2,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;%</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp;&nbsp;0,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2,8&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5,6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;14,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;28,0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;56,0&nbsp;&nbsp;&nbsp;&ge;&nbsp;&nbsp;112,0&nbsp;&nbsp; ммоль/л</p>\r\n<p class=\"Textbody\">&nbsp;&nbsp;&nbsp;0,0&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;50&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;100&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;250&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;500&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;1000&nbsp;&nbsp;&nbsp;&ge;&nbsp; 2000&nbsp;&nbsp;&nbsp;&nbsp;мг/дл</p>\r\n<p class=\"Textbody\">Определение высоко чувствительно к наличию глюкозы в моче, реагируя на ее присутствие уже в концентрации от 0,6 до 0,9 ммоль/л. Сенсорная зона имеет необходимую защиту от воздействия аскорбиновой кислоты. Аскорбиновая кислота в концентрациях от 20 мг%&nbsp;может незначительно занижать результаты определения. Реальная скорость определения 45 сек.</p>\r\n<p class=\"Textbody\" align=\"center\"><strong>МЕРЫ ПРЕДОСТОРОЖНОСТИ</strong></p>\r\n<p class=\"Textbody\" style=\"text-align: left;\" align=\"center\">Потенциальный риск применения полосок индикаторных &ndash; класс 2а.</p>\r\n<p class=\"Textbody\" style=\"text-align: left;\" align=\"center\">Все компоненты полосок индикаторных являются нетоксичными.</p>\r\n<p class=\"Textbody\">Поскольку цветные шкалы различных серий комплектов полосок индикаторных могут отличаться по окраске, необходимо сравнивать окраску сенсорного элемента полоски только со шкалами той упаковки, из которой была взята полоска индикаторная.</p>\r\n<p class=\"Textbody\">Для сохранения активности полоски индикаторной следует избегать прикосновений руками к сенсорному элементу.</p>\r\n<p class=\"Textbody\">При работе с полосками индикаторными следует соблюдать общие правила санитарии.</p>\r\n<p class=\"Textbody\" align=\"center\"><strong>ПРОВЕДЕНИЕ ОПРЕДЕЛЕНИЯ</strong></p>\r\n<p class=\"Textbody\" style=\"text-align: left;\" align=\"center\">&nbsp;Для определения использовать свежесобранную (не более чем за 2 часа до анализа) в чистую посуду мочу.</p>\r\n<p class=\"Textbody\">Открыть пенал или вскрыть пакет, извлечь из него полоску индикаторную. (в случае пенала - немедленно плотно закрыть пенал крышкой). Погрузить сенсорные элементы Полоски полностью в мочу. Через 4-5 секунд извлечь полоску и удалить избыток жидкости на сенсорных элементах резким движением руки, или осторожным прикосновением ребром полоски к чистой фильтровальной бумаге на 2-3 секунды, или осторожным прикосновением ребром полоски к стенке посуды с мочой. Положить полоску индикаторную на ровную чистую сухую поверхность сенсорными элементоми вверх.</p>\r\n<p class=\"Textbody\">Через 2 минуты с момента погружения сенсорных элементов в мочу сравнить окраску сенсорного элемента с соответствующей цветной шкалой на этикетке упаковки комплекта при хорошем освещении.</p>\r\n<p class=\"Textbody\">Изменение окраски сенсорных элементов свидетельствует о наличии кетоновых тел и глюкозы в моче (качественное определение). Полуколичественное определение провести путем сопоставления окраски сенсорных элементов с соответствующими цветовыми полями шкал.</p>\r\n<p class=\"Textbody\" align=\"center\"><strong>ЧУВСТВИТЕЛЬНОСТЬ И СПЕЦИФИЧНОСТЬ ОПРЕДЕЛЕНИЯ</strong></p>\r\n<p class=\"Textbody\">&nbsp;Определение кетоновых тел высоко чувствительно к их наличию в моче, реагируя на их присутствие уже в концентрации 0,5 ммоль/л. Сенсорная зона имеет необходимую защиту от воздействия аскорбиновой кислоты. Лекарственные и диагностические препараты на основе фенолфталеина, сульфонфталеина, а также других веществ, содержащих сульфгидрильные группы, могут давать ложноположительные или ложноотрицательные результаты. Неправильные результаты могут быть вызваны недостаточной чистотой посудой для сбора мочи.</p>\r\n<p class=\"Textbody\">Определение высоко чувствительно к наличию глюкозы в моче, реагируя на ее присутствие уже в концентрации от 0,6 до 0,9 ммоль/л. Сенсорная зона имеет необходимую защиту от воздействия аскорбиновой кислоты. Аскорбиновая кислота в концентрациях от 20 мг%&nbsp;может незначительно занижать результаты определения. Ложноположительные или ложноотрицательные результаты могут быть вызваны недостаточной чистотой посудой для сбора мочи.</p>\r\n<p class=\"Textbody\" align=\"center\">&nbsp;<strong>УСЛОВИЯ ХРАНЕНИЯ И ЭКСПЛУАТАЦИИ</strong></p>\r\n<p class=\"Textbody\" style=\"text-align: left;\" align=\"center\">&nbsp;Полоски индикаторные должны храниться в упаковке предприятия-изготовителя в сухом месте при температуре +10 - +30&nbsp;оС (при отсутствии паров кислот, щелочей и органических растворителей) в течение всего срока годности (24 месяца).</p>\r\n<p class=\"Textbody\">Определение содержания глюкозы и кетоновых тел в моче следует проводить при температуре +15 - +30&nbsp;оС.</p>\r\n<p class=\"Textbody\">Необходимо предохранять полоски индикаторные от повышенной влажности и воздействия прямых солнечных лучей. Следует избегать попадания прямых солнечных лучей на цветную шкалу.</p>\r\n<p class=\"Textbody\">Каждая полоска индикаторная предназначена для проведения одного определения содержания кетоновых тел и глюкозы.</p>\r\n<p class=\"Textbody\">После вскрытия пенала полоски индикаторные должны быть использованы в течение всего срока годности.</p>\r\n<p class=\"Textbody\">Извлеченная из упаковки полоска индикаторная должна быть использована для проведения анализа в течение часа.</p>\r\n<p class=\"Textbody\">Каждый раз после извлечения полоски индикаторной из пенала последний следует немедленно и плотно закрыть крышкой.</p>\r\n<p class=\"Textbody\">Для получения надежных результатов необходимо строгое соблюдение инструкции по применению.</p>\r\n<p class=\"Textbody\">По вопросам, касающимся качества полосок индикаторных для полуколичественного определения глюкозы и кетоновых тел в моче&nbsp; &laquo;Кетоглюк-1&raquo; обращаться в ООО &laquo;Биосенсор АН&raquo;: 142432, Московская обл., г. Черноголовка, а/я 4, тел/факс: +7(496) 522-16-08, 522-11-41, 522-15-89.</p>'),(171,4,83,0,26,NULL),(172,4,106,0,26,NULL),(173,4,72,0,27,'<p class=\"Standard\">Тест полоски Акку-Чек Перформа предназначены для глюкометров Акку-Чек Перформа, Акку-Чек Перформа Нано и пульту управления с функцией глюкометра&nbsp;Акку-Чек Перформа Комбо (к инсулиновой помпе&nbsp;Акку-Чек Спирит Комбо) для измерения уровня глюкозы в крови.&nbsp;</p>\r\n<ul>\r\n<li>Метод заполнения тест-полоски &ndash; капиллярный</li>\r\n<li>Тест-полоски калиброваны по плазме кровиКоличествово тест полосок в упаковке:&nbsp;50 штук.</li>\r\n<li>Производитель:&nbsp;Roche Diagnostics GmbH, Германия.</li>\r\n<li>Температура хранения от +2 до +30&deg;С. Не замораживать.</li>\r\n<li>Срок годности: 18 месяцев.</li>\r\n</ul>'),(174,4,73,0,27,'Тест-полоски Акку-Чек Перформа'),(175,4,151,0,27,NULL),(176,4,83,0,27,NULL),(177,4,106,0,27,NULL),(178,4,72,0,28,'<ul>\r\n<li>Тестовые полоски для глюкометра accu-chek active (Акку Чек Актив), Accu-Chek Active New.</li>\r\n<li>Кодирующий чип внутри тубуса с тест-полосками, который необходимо вставить в глюкометр перед использованием новой упаковки с тест-полосками.</li>\r\n<li>Время измерения &ndash; 5 секунд.</li>\r\n<li>Необходимый размер капли крови: 1-2 мкл.</li>\r\n<li>Тест-полоски калиброваны по плазме кровиТемпература хранения &ndash;&nbsp; + 2 +30˚С</li>\r\n<li>Визуальный контроль: сравнение цвета круглого окошка на обратной стороне тест-полоски с цветовой шкалой на тубусе.</li>\r\n<li>50 штук в упаковке.</li>\r\n<li>После вскрытия тест-полоски можно использовать до окончания срока годности.</li>\r\n<li>Производство Roche Diagnostics, Германия</li>\r\n</ul>'),(179,4,73,0,28,'Тест-полоски Акку-Чек Актив '),(180,4,151,0,28,NULL),(181,4,83,0,28,NULL),(182,4,106,0,28,NULL),(183,4,72,0,29,'<p class=\"Heading11\">Технические характеристики&nbsp;</p>\r\n<ul>\r\n<li>Метод измерения:&nbsp;электрохимический</li>\r\n<li>Калибровка результата:&nbsp;по плазме крови</li>\r\n<li>Объем капли крови:&nbsp;2,5 мкл.</li>\r\n<li>Время измерения:<strong>&nbsp;</strong>10 сек.</li>\r\n<li>Память:&nbsp;70 измерений.</li>\r\n<li>Диапазон измерений:&nbsp;1,6-33,3 ммоль/л</li>\r\n<li>Кодировка тест-полосок:&nbsp;с помощью чипа</li>\r\n<li>Масса:&nbsp;75 г</li>\r\n<li>Передача данных на ПК</li>\r\n<li>Тип батарейки:&nbsp;ААА, 2 шт.</li>\r\n<li>Средний срок службы: не менее 10 лет</li>\r\n<li>Производитель: Visgeneer (Тайвань)</li>\r\n</ul>'),(184,4,73,0,29,'Глюкометр eBsensor'),(185,4,151,0,29,NULL),(186,4,83,0,29,NULL),(187,4,106,0,29,NULL),(188,4,72,0,30,'<p class=\"Heading11\">Технические характеристики&nbsp;</p>\r\n<ul>\r\n<li>Метод измерения:&nbsp;электрохимический</li>\r\n<li>Калибровка результата:&nbsp;по плазме крови</li>\r\n<li>Объем капли крови:&nbsp;1,2 мкл.</li>\r\n<li>Время измерения:<strong>&nbsp;</strong>9 сек.</li>\r\n<li>Память:&nbsp;180 измерений.</li>\r\n<li>Диапазон измерений:&nbsp;1,7- 41,7 ммоль/л</li>\r\n<li>Кодировка тест-полосок:&nbsp;с помощью кодирующего стрипа</li>\r\n<li>Масса:&nbsp;50 г</li>\r\n<li>Рабочая температура: +10 - +40˚С</li>\r\n<li>Передача данных на ПК через микро-USB</li>\r\n<li>Тип батарейки:&nbsp;литиевая, CR2032, 1 штука.</li>\r\n<li>Продолжительность работы батарейки: более 1000 измерений</li>\r\n<li>Производитель: Диамедикал ЛТД, Великобритания/ Тайвань</li>\r\n</ul>'),(189,4,73,0,30,'Глюкометр Айчек'),(190,4,151,0,30,NULL),(191,4,83,0,30,NULL),(192,4,106,0,30,NULL),(193,4,151,0,23,NULL),(202,4,72,0,31,'<p class=\"Standard\">Тест кассета&nbsp;Accu-Chek Mobile (Акку-Чек Мобайл)<strong>,</strong> &nbsp;содержит 50 тестов на одной ленте, которая автоматически перематывается на следующее тест-поле после каждого измерения. Лента хранится в тестовом картридже, который легко меняется, после использования всех 50 тестов.&nbsp;</p>\r\n<ul>\r\n<li>Предназначены для использования только с глюкометром&nbsp;Accu-Chek Mobile (Акку-Чек Мобайл).&nbsp;</li>\r\n<li>Для глюкометра:&nbsp;Акку-Чек Мобайл(Accu-Chek Mobile)</li>\r\n<li>Тест-полоски калиброваны по плазме крови</li>\r\n<li>Температура хранения от +2 до +30&deg;С. Не замораживать.</li>\r\n<li>Количество тестов в упаковке:&nbsp;50 шт.</li>\r\n</ul>\r\n<p>Производитель:&nbsp;Roche Diagnostics GmbH, Германия.</p>'),(203,4,73,0,31,'Тест-кассеты для глюкометра Акку-Чек Мобайл'),(204,4,151,0,31,NULL),(205,4,83,0,31,NULL),(206,4,106,0,31,NULL),(207,4,72,0,32,'<ul>\r\n<li>Тест-полоски предназначены для глюкометров OneTouch Ultra и OneTouch Ultra Easy.</li>\r\n<li>Уникальная многослойная структура тест-полоски OneTouch Ultra обеспечивает исключительную точность получаемых результатов.</li>\r\n<li>Капилляр тест-полоски сам втягивает необходимый для анализа объем крови.</li>\r\n<li>Тест-полоски калиброваны по плазме крови</li>\r\n<li>Образец крови: капиллярная</li>\r\n<li>Количество в упаковке: 100 тест-полосок, 4 баночки по 25 шт.</li>\r\n<li>Производство Johnson&amp; Johnson LifeScan , США.</li>\r\n</ul>'),(208,4,73,0,32,'Тест-полоски Ван Тач Ультра'),(209,4,151,0,32,NULL),(210,4,83,0,32,NULL),(211,4,106,0,32,NULL),(212,4,72,0,33,'<ul>\r\n<li>Предназначены для глюкометров OneTouch Select (Уан Тач Селект) и OneTouch Select Simple (Уан Тач СелектСимпл).</li>\r\n<li>Тест-полоски калиброваны по плазме крови</li>\r\n<li>Образец крови: капиллярная</li>\r\n<li>Многослойная структура тест-полоски защищает чувствительные элементы тест-полоски от влаги, температуры, ультрафиолета, обеспечивая стабильность при хранении.</li>\r\n<li>100 штук в упаковке (4 флакона по 25 штук).</li>\r\n<li>Производство Johnson&amp; Johnson LifeScan , США.</li>\r\n</ul>'),(213,4,73,0,33,'Тест-полоски Ван Тач Селект'),(214,4,151,0,33,NULL),(215,4,83,0,33,NULL),(216,4,106,0,33,NULL),(217,4,72,0,34,'<ul>\r\n<li>Тест-полоски Ван Тач Верио предназначены для глюкометра <a href=\"http://www.medmag.ru/index.php?productID=1247\">ВанТач Верио Про Плюс (OneTouch Verio Pro+)</a>&nbsp;.</li>\r\n<li>Калибровка прибора: по плазме</li>\r\n<li>Объем капли крови: 0,4 мкл.</li>\r\n<li>Образец крови: капиллярная, венозная, артериальная</li>\r\n<li>Каплю крови можно наносить с любой боковой стороны тест-полоски OneTouch Verio, а капиллярное окно для визуального контроля позволяет убедиться, что нанесено достаточное количество образца крови.</li>\r\n<li>Время использования тест-полосок п