38,'•	Тест-полоски используются в глюкометрах: Bionime Rightest GM300, Bionime Rightest GM110, Bionime Rightest GM500 \r\n•	Калибровка результата: по плазме крови\r\n•	Объем капли крови: 1,4 мкл.\r\n•	Время измерения: 8 сек.\r\n•	Диапазон измерений: 0,6-33,3 ммоль/л\r\n•	Кодировка тест-полосок: с помощью чипа\r\n•	Контакты тест-полоски из сплава золота обеспечивают идеальную проводимость\r\n•	50 тест полосок в комплекте\r\n•	Производитель: Bionime (Швейцария) \r\n'),(238,4,73,0,38,'Тест-полоски Бионайм Райтест GS300 '),(239,4,151,0,38,NULL),(240,4,83,0,38,NULL),(241,4,106,0,38,NULL),(242,4,72,0,39,'<ul>\r\n<li>Используются в глюкометре&nbsp;Диаконт&nbsp;(Diacont)</li>\r\n<li>Калибровка результата:&nbsp;по плазме крови</li>\r\n<li>Объем капли крови:&nbsp;0,7 мкл.</li>\r\n<li>Время измерения:<strong>&nbsp;</strong>6 сек.</li>\r\n<li>Наличие индикаторов&nbsp; гипогликемии (&lt;3,5 ммоль/л) и гипергликемии (&gt;9,0 ммоль/л)</li>\r\n<li>Диапазон измерений:&nbsp;1,1- 33,3 ммоль/л</li>\r\n<li>Кодировка тест-полосок:&nbsp;не требуется.</li>\r\n<li>50 штук в упаковке</li>\r\n<li>Производитель: Diacont (Россия), OK Biotech (Тайвань)</li>\r\n</ul>'),(243,4,73,0,39,'Тест-полоски Диаконт'),(244,4,151,0,39,NULL),(245,4,83,0,39,NULL),(246,4,106,0,39,NULL),(247,4,72,0,40,'<ul>\r\n<li>Тест-полоски предназначены для глюкометра eBsensor</li>\r\n<li>Метод забора крови &ndash; капиллярный</li>\r\n<li>Время измерения 7 секунд</li>\r\n<li>Всего 100 штук в упаковке, разделены на 4 баночки по 25 штук.</li>\r\n<li>Производитель: Visgeneer (Тайвань)</li>\r\n</ul>'),(248,4,73,0,40,'Тест-полоски eBsensor'),(249,4,151,0,40,NULL),(250,4,83,0,40,NULL),(251,4,106,0,40,NULL),(252,4,72,0,41,'<ul>\r\n<li>Тест-полоски предназначены для глюкометра Сенсокард</li>\r\n<li>Калибровка результата:&nbsp;по цельной крови</li>\r\n<li>Объем капли крови:&nbsp;0,5 мкл.</li>\r\n<li>Время измерения:<strong>&nbsp;</strong>5 сек.</li>\r\n<li>Кодировка: с помощью кодирующей тест-полоски.</li>\r\n<li>Производитель: 77_El