Johnson&amp;Johnson, США</li>\r\n</ul>'),(283,4,73,0,47,'Ланцеты Ван Тач Ультра Софт упаковка 25 шт'),(284,4,151,0,47,NULL),(285,4,83,0,47,NULL),(286,4,106,0,47,NULL),(287,4,72,0,48,'<p>Стерильные одноразовые ланцеты OneTouch UltraSoft предназначеные для получения капли крови</p>\r\n<ul>\r\n<li>Игла имеет специальную лазерную заточку для практически безболезненного получения капли крови из пальца или альтернативных мест.</li>\r\n<li>Квадратное основание ланцеты позволяет использовать с ручками-прокалывателями большинства производителей</li>\r\n<li>Диаметр иглы в самой широкой части - всего 0, 36 мм (28G)</li>\r\n<li>Количество в упаковке&nbsp;&mdash;&nbsp;100 шт.</li>\r\n<li>Производитель Johnson&amp;Johnson, США</li>\r\n</ul>'),(288,4,73,0,48,'Ланцеты Ван Тач Ультра Софт упаковка 100 шт'),(289,4,151,0,48,NULL),(290,4,83,0,48,NULL),(291,4,106,0,48,NULL),(292,4,72,0,49,'<p>Ланцеты Droplet 200 подходят ко всем прокалывателям, кроме Акку-Чек, которые выпускают собственные ланцеты <a title=\"Купить ланцеты СофтКликс\" href=\"http://xn--74-glciyfiput1k.xn--p1ai/prokalivateli-i-lanceti/lanceti-softclix.html\">Софткликс</a> и Мультикликс</p>\r\n<ul>\r\n<li>Диаметр иглы 0,36 мм (0,28 G)</li>\r\n<li>Острие иглы трехгранное</li>\r\n<li>Лазерная заточка</li>\r\n<li>Производитель: ЭйчТиЭл-СТЕФА. С.А., Польша</li>\r\n</ul>'),(293,4,73,0,49,'Ланцеты Дроплет упаковка 200 шт'),(294,4,151,0,49,NULL),(295,4,83,0,49,NULL),(296,4,106,0,49,NULL),(297,4,72,0,50,'<p>Ланцеты Микролет являются одноразовыми, универсальными, подходят для большинства прокалывателей: Bayer Microlet (от глюкометра Контур ТС),&nbsp;<a href=\"http://diamarka.com/catalog/lantsety-i-prokalyvateli/9736-ruchka-dlya-prokalyvaniya-van-tach-ultra-soft\">OneTouch UltraSoft</a>, Сателлит, Сателлит Плюс. Каждый сверхтонкий стерильный ланцет Микролет №200 имеет специальный защитный колпачок, который еще больше способствует надежности и удобству его использования.</p>\r\n<p>Количество в упаковке 200 шт.</p>\r\n<p>Производитель: Bayer</p>'),(298,4,73,0,50,'Ланцеты Микролет №200'),(299,4,151,0,50,NULL),(300,4,83,0,50,NULL),(301,4,106,0,50,NULL),(302,4,72,0,51,'<p>Лекарственный препарат Актрапид НМ Пенфилл зарегистрирован согласно российскому законодательству.&nbsp;</p>\r\n<ul>\r\n<li>Действующее вещество: инсулин человеческий генноинженерный короткого действия</li>\r\n<li>Начало действия препарата &ndash; через полчаса после введения</li>\r\n<li>Максимальный эффект &ndash; через 1,5 &ndash; 3,5 часа после введения препарата</li>\r\n<li>Длительность действия 7- 8 часов.</li>\r\n<li>В 1 мл раствора содержится 100 ЕД инсулина.</li>\r\n<li>1 картридж содержит 3 мл раствора инсулина, что соответствует 300&nbsp;ЕД;</li>\r\n<li>В упаковке содержится 5 картриджей.</li>\r\n<li>Картриджи предназначены для использования со шприц-ручками НовоПен 4 и НовоПен Эхо.</li>\r\n<li>Хранится при температуре от 2˚ до 8˚C: в холодильнике или в специальной термо-сумке с хладогеном.</li>\r\n<li>Не замораживать.</li>\r\n<li><strong>Применяется только по назначению врача</strong></li>\r\n<li>Производитель: НовоНордиск (Дания)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p class=\"message bg-danger text-danger\"><strong>Перед применением препарата необходимо ознакомиться с инструкцией.</strong></p>'),(303,4,73,0,51,'Актрапид НМ Пенфилл '),(304,4,151,0,51,NULL),(305,4,83,0,51,NULL),(306,4,106,0,51,NULL),(307,4,72,0,52,'<p>Лекарственный препарат Актрапид НМ зарегистрирован согласно российскому законодательству.&nbsp;</p>\r\n<ul>\r\n<li>Действующее вещество: инсулин человеческий генноинженерный короткого действия</li>\r\n<li>Начало действия препарата &ndash; через полчаса после введения препарата</li>\r\n<li>Максимальный эффект &ndash; через 1,5 &ndash; 3,5 часа после введения</li>\r\n<li>Длительность действия 7- 8 часов.</li>\r\n<li>В 1 мл раствора содержится 100 ЕД инсулина.</li>\r\n<li>1 флакон содержит 10 мл раствора инсулина, что соответствует 1000&nbsp;ЕД;</li>\r\n<li>Используется с инсулиновыми шприцами Микрофайн БД 1 мл, 0,5 мл, 0,3 мл.</li>\r\n<li>Хранится при температуре от 2˚ до 8˚C: в холодильнике или в специальной термо-сумке с хладогеном.</li>\r\n<li>Не замораживать.</li>\r\n<li><strong>Применяется только по назначению врача</strong></li>\r\n<li>Производитель: НовоНордиск (Дания)&nbsp;</li>\r\n</ul>\r\n<p class=\"message bg-danger text-danger\"><strong>Перед применением препарата необходимо ознакомиться с инструкцией.</strong></p>'),(308,4,73,0,52,'Актрапид НМ флакон 10 мл '),(309,4,151,0,52,NULL),(310,4,83,0,52,NULL),(311,4,106,0,52,NULL),(312,4,72,0,53,'<p>Лекарственный препарат Протафан НМ Пенфилл зарегистрирован согласно российскому законодательству.&nbsp;</p>\r\n<ul>\r\n<li>Действующее вещество: инсулин-изофан (человеческий генноинженерный) средней продолжительности действия</li>\r\n<li>Начало действия препарата &ndash; через 1,5 часа после введения</li>\r\n<li>Максимальный эффект достигается в течение 4 &ndash; 12 часов после введения</li>\r\n<li>Длительность действия около 24 часов.</li>\r\n<li>Суспензия белого цвета, которая расслаивается, образует белый осадок и прозрачную надосадочную жидкость. Перед применением требуется немного встряхнуть картридж.</li>\r\n<li>В 1 мл содержится 100 ЕД инсулина.</li>\r\n<li>1 картридж содержит 3 мл суспензии инсулина, что соответствует 300&nbsp;ЕД;</li>\r\n<li>В упаковке содержится 5 картриджей.</li>\r\n<li>Картриджи предназначены для использования со шприц-ручками НовоПен 4 и НовоПен Эхо.</li>\r\n<li>Хранится при температуре от 2˚ до 8˚C: в холодильнике или в специальной термо-сумке с хладогеном.</li>\r\n<li>Не замораживать.</li>\r\n<li><strong>Применяется только по назначению врача</strong></li>\r\n<li>Производитель: НовоНордиск (Дания)&nbsp;</li>\r\n</ul>\r\n<p class=\"message bg-danger text-danger\"><strong>Перед применением препарата необходимо ознакомиться с инструкцией.</strong></p>'),(313,4,73,0,53,'Протафан НМ Пенфилл '),(314,4,151,0,53,NULL),(315,4,83,0,53,NULL),(316,4,106,0,53,NULL),(321,4,72,0,54,'<p>Лекарственный препа